(16456, NULL, 0, 19, 23, 'Ultra Music Festival', '25', '01:00 PM', '11:30 PM', '', '', 'Ultra Music Festival is an outdoor electronic music event held annually in Miami Florida United States during the Winter Music Conference which occurs annually during the month of March. It is a 2-day event (although it was a 1-day event until 2007 and has been announced to be 3 days in 2011) that takes place across 12 different stages featuring over 200 artists DJs producers and promoters. It was announced on the second kjjknight of Ultra Music Festival 2010 that UMF 2011 in Miami would be a three day event.From 2001 to 2005 UMF was held outdoors in Bayfront Park Miami. The first two UMFs (1999 & 2000) were actually held on South Beach in Miami Beach however UMF attendance exceeded the possible beach permits and was subsequently moved to the venue of Bayfront Park. The top DJs artists and VJ (video performance artist) of the evening perform in the amphitheater designed to hold thousands of attendees. There is a second main stage (called the ''Sound stage'') and 10 other specialized music areas scattered throughout the park featuring Dubstep Drum and Bass House Techno Electro Breakbeats Trance and other various styles of electronic music.In 2005 the concert was so popular that it sold out. With the festival growing so big in 2006 the Miami event had been moved to an even bigger venue Bicentennial Park next door to its past home. In 2007 with Winter Music Conference in full swing Ultra Music Festival had its first 2-Day Event held at Bicentennial Park with a record breaking 50000+ electronic music fans. Ultra Music Festival celebrated its 10th anniversary on Friday and Saturday March 28 and 29th 2008 where an announcement was made that the festival had set a new City of Miami record for the number of tickets sold at a single event. It is estimated that over 70000 people attended. This year 2010 Ultra Music Festival was again held at Bicentennial Park with headliners such as Axwell Tiesto David Guetta DJ Big Rebs Deadmau5 and many more. It took place from Friday March 26th (4:00PM to 12:00A) to Saturday March 27th (12:00PM to 12:00AM).In 2010 Ultra Music Festival made history by completely selling out. It was one of the highest grossing musical festivals in the United States.Ultra Music Festival in association with Ultra Records produces an event in New York City''s Central Park called ULTRA:NY which also sold out in 2005. The success has brought Ultra:NY back for a second year.Ultra Music Festival is currently presenting a radio show each week on Sirius satellite radio.', '0', '132957936746808_100000136613412.jpg', 'No', '5', '0', NULL, '0.0', NULL, '0', ''),
