(19899, NULL, 0, 21, 39, '2011 All-Star High School Basketball Classic', '18', '03:00 PM', '05:00 PM', '', '', 'Come watch the top-talented basketball seniors from Orange County high schools compete in the annual All-Star game slam dunk contest starring celebrity judges and a boys and girls 3-point shoot out.The All-Star Classic will also feature Orlando Magic&#039;s Community Ambassadors Nick Anderson and Bo Outlaw as celebrity coaches and special appearances by Magic Dancers and STUFF the Magic Mascot!Prize giveaways for fans and a family fanfest featuring fun games face-painting and 102 Jamz&#039;s DJ D-Strong and Jay Love!', 'Free til 1pm and $50 afterwards', 'uncfallstargame-final-copy_212937.jpg', 'No', '3', '1', NULL, '0.0', NULL, '0', ''),
(20254, NULL, 0, 18, 34, '2011 PCS Catastrophe Conference', '53', '09:00 AM', '05:00 AM', '', '', 'PCS Catastrophe Conference has been bringing together professionals in the catastrophe-response business to explore new strategies and tools for catastrophe management. Throughout the conference  experts discuss targeted topics in depth  while sharing their own experiences  offering practical solutions  and bringing new ideas to the table. Whether you''re involved in claims  underwriting  actuarial  research and development  or loss control operations  or if you have an interest in insurance linked securities  you''ll find valuable information in each session. All sessions are interactive  and we encourage you to exchange your views with the experts and share your ideas with your peers.', '', 'pcs-conf-ban-2010_01.gif', 'Yes', '5', '1', NULL, '0.0', NULL, '0', ''),
