(21711, NULL, 0, 17, 32, '50th Apopka Art and Foliage Festival', '53', '9:00 AM ', ' 5:00 PM', '', '', '"It is that time of year again! The 50th Apopka Art and Foliage Festival bringing in Spring with new and fun filled entertainment and activities. The event will take place at Kit Land Nelson Park located between First Street and Orange Avenue as you go North on Park Avenue off of SR 441. The Honorable Mayor John H. Land will open the Festival at 9:30 am. More than 30 000 are expected to browse the 150 + juried artists and crafters from throughout Florida and across the nation  who will sell their work and compete for cash awards and ribbons. The awards ceremony will take place at 1:00 p.m. on Sunday  May 1. If you are looking for it  we probably have it. Beautiful original art to decorate your walls  hand crafted pottery  woodworking  stained glass  sculptures  basketry  and weavings to enhance your home or workplace  jewelry to enhance you. Garden art to display the foliage and flowers you will find at our diverse festival. ""Spring Ahead - Re-plant  Re-Grow  and Re-Vitalize"" is the theme for the foliage sales area. Drought resistant plants and a myriad of favorite indoor and outdoor foliage will be in abundance from fifteen Apopka''s area nurseries. Of course  horticulturists  our famous plant doctors are available  along with growers  to answer plant care and gardening queries."', 'Free', '749-5.jpg', 'No', '3', '1', NULL, '0.0', NULL, '0', ''),
