(22452, NULL, 0, 17, 32, 'A Window into Tiffany', '53', ' 4:00 PM', '8:00 p.m. ', '', '', 'The Charles Hosmer Morse Museum of American Art in Winter Park was already home to one of the most comprehensive collections of the work of celebrated decorative artist Louis Comfort Tiffany  but last week it cinched its reputation as the museum for Tiffany art and fine-art objects. With the opening of 10 new galleries dedicated to interpretive exhibits from Tiffany''s art-glass legacy  as well as architectural fragments from Laurelton Hall  Tiffany''s famed New York estate  a more complete picture is available of the man known for his exquisite lamps.  Winter Park architecture firm Rogers  Lovelock & Fritz designed the project  working alongside world-class lighting and exhibit designers  the new wing was opened to the public on Feb. 19. If it wasn''t already  Tiffany''s legacy is now firmly ensconced in Central Florida  revealing as much about our place in history as it does about _Tiffany''s work.', '$5.00 ', 'i_daffodils.jpg', 'No', '3', '1', NULL, '0.0', NULL, '0', ''),
(22824, NULL, 0, 18, 34, 'A&amp;WMA Conference and Exhibition - ACE 2011', '53', '09:00 AM', '05:00 AM', '', '', '&quot;A&amp;WMAâ€™s 104th ACE will take place at the Disney&#039;s Coronado Springs Resort  June 21-24  2011. This yearâ€™s theme  &quot;&quot;Beyond All Borders&quot;&quot; will focus on how environmental challenges often stretch beyond the political  regional and cultural lines people have developed  involving diverse communities in their eventual solutions. &quot;', 'Cost Unknown', 'ACE2011_091346.jpg', 'Yes', '5', '1', NULL, '0.0', NULL, '0', ''),
