(23946, NULL, 0, 18, 35, 'ANNUAL GLOBAL LEAN SIX SIGMA AND BUSINESS IMPROVEMENT SUMMIT & INDUSTRY AWARDS 2011', '53', '09:00 AM', '05:00 AM', '', '', 'The WCBF Global Lean  Six Sigma & Business Improvement Summit and Industry Awards is the largest senior-level benchmarking event focussed on Lean Six Sigma deployments in the industry and the awards program is considered to be the most prestigious. It is where the key players in the industry gather to exchange key learningâ€™s and network.', '', 'annual-global-lean-six-sigma-and-business-improvement-summit-industry-awards-logo.jpg', 'Yes', '5', '1', NULL, '0.0', NULL, '0', ''),
(24322, NULL, 0, 18, 35, 'Annual Meeting of the FRS &amp; FRBMA 2011', '53', '09:00 AM', '05:00 AM', '', '', '&quot;Join us Friday morning as we tee off the weekend with our annual FRS/FRBMA Golf Tournament. Friday evening promises to bring exhibitors and members together for the popular Wine and Cheese Reception which will be held in the Exhibit Hall. Please be sure to visit with the exhibitors and thank them for their continued support of the FRS &amp; FRBMA. Breakfast  Lunch and the Coffee Breaks will be held in the Exhibit Hall on Saturday to allow for maximum interaction with the exhibitors.The exciting and dynamic education begins with the FRBMA Session on Friday afternoon and continues on Saturday morning with an outstanding lineup of speakers. The focus of this year&#039;s meeting is Radiology: Are We the New Enemy? On Sunday morning  don&#039;t miss the Irwin L. Entel M.D.  FACR Legacy Lecture given this year by Dr. Steven Miles.&quot;', 'Free', 'FRS11_195544.png', 'Yes', '5', '1', NULL, '0.0', NULL, '0', ''),
(24699, NULL, 0, 18, 35, 'Annual Meeting of the Society of Gynecologic Oncologists 2011', '53', '09:00 AM', '05:00 AM', '', '', 'The SGO Annual Meeting on Women''s Cancer offers a variety of exceptional educational experiences  as well as a wide range of opportunities to network with colleagues and friends from across the country and the globe.  Set in a venue that reflects the fast-paced nature of this surgical sub-specialty  the SGO Annual Meeting will attract over 1800 members and guests ranging from gynecologic oncologists  medical oncologists  radiation oncologists  obstetricians  gynecologists  fellows and residents in the area of OB/GYN and GYN oncology  nurses  scientists  health care professionals  pharmaceutical and device company representatives and others involved in the care of patients with gynecologic malignancies. ', '', 'annual-meeting-of-the-society-of-gynecologic-oncologists-logo.jpg', 'Yes', '5', '1', NULL, '0.0', NULL, '0', ''),
(25077, NULL, 0, 21, 40, 'APT College Baseball Showcase', '20', '08:00 AM', '11:00 AM', '', '', '*2 Day Event with Pro Style Workout and Games    * Work stations &amp; instruction from college coaches.    * Written evaluation by former NY Yankees Scouting Supervisor Joe Arnold.    * Player information will be sent to all college coaches in Florida.    * Personal training recommendations based on your APT results.    * College recruiting seminar for athletes and parents.    * 1 Month membership to GetMyNameOut.com ($50 value).    * All registered college coaches and pro scouts in attendance will be provided with your details and contact information.    * College coaches will be provided with a direct link to your GetMyNameOut.com profile.College Coaches: University of Central Florida University of South Florida University of North Florida Rollins College University of Tampa Santa Fe Community College Barry University St.  Petersburg College Saint Leo University Southeastern University Hillsborough Community College Florida Southern College Philadelphia Phillies Utica Brewers.Program:Pro Style Workout2 Games Primary Pitchers Game 1 Secondary PitchersGame 2. Primary Pitchers can play 2nd pos. in Game 2Position Specific Work Stations &amp; Seminars with College Coaches:- College Pitching Philosophy- College Hitting Philosophy- College Infield Drills- College Outfield Drills- College Catching- College Pitchers Fielding PracticeSimulated Games Saturday and SundayRecruiting Seminar$249$49 Early Registration Discount for Facebook members coupon code: Orlando612 - Expires 4/1/11Register at: http://www.getmynameout.com/contents/gmno-events/orlando--fl-apt-baseball-showcase1', '$0.00 ', '192121510801322_123966167614127.jpg', 'No', '5', '1', NULL, '0.0', NULL, '0', ''),
(25456, NULL, 0, 18, 34, 'Assn. of Legal Administrators 2011 Annual Conf. & ExpositionImagine the Possibilities', '53', '09:00 AM', '05:00 AM', '', '', 'The Association of Legal Administrators'' Annual Conference & Exposition is legal management profession''s most comprehensive event of its kind. Featuring dynamic and relevant educational sessions  outstanding networking opportunities and a three-day Exposition  the Conference gives legal management professionals the opportunity to develop their personal and professional growth.', '', 'TouchstoneLegalAd-350.jpg', 'Yes', '5', '1', NULL, '0.0', NULL, '0', ''),
(25836, NULL, 0, 16, 53, 'B.o.B Live in Concert', '18', '07:00 PM', '10:00 PM', '', '', 'Sometimes it pays to be different. Hailing from Atlanta Georgia a city known for its outcasts B.o.B is truly out of the ordinary. At just 19 years old the rapper - born Bobby Ray Simmons - has become a breath of fresh air in AtlantaÃ¢â‚¬â„¢s snap and trap-obsessed scene. Known primarily for his heavy smokers anthem Ã¢â‚¬Å“Cloud 9Ã¢â‚¬Â and the frenetic energy of his song Ã¢â‚¬Å“Haterz EverywhereÃ¢â‚¬Â B.o.B scored a record deal with Atlantic Records while he was still in high school. Now the teen-aged rap phenomenon is ready to bring his genre-bending style nationwide with his highly anticipated debut The Adventures of B.o.B.', '$0.00 ', '183830708310893_123966167614127.jpg', 'No', '5', '1', NULL, '0.0', NULL, '0', ''),
(26217, NULL, 0, 19, 25, 'BB Kings All Star Band', '18', '09:30 AM', '01:30 AM', '', '', 'B.B. King&#039;s Orlando offers a variety of the SouthÃ¢â‚¬â„¢s most delicious comfort food influenced by flavors from New Orleans all the way to the Mississippi Delta including authentic Memphis-style BBQ. This supper-club style restaurant &amp; live music venue has some of the finest live local entertainment in town. Our highly trained staff are experts in all aspects of event planning and can handle any and all of your needs. The incredible facility consists of three different areas ranging from an outside patio a mezzanine that looks over the main stage and a large seating area with live music daily. We can accommodate small intimate groups of 20 to grand celebrations of 1500.Features:Stage for live music with a dance floorFull-service retail store3 full-service bars (plus 1 patio bar open for special parties and events)Television monitors throughout the restaurantMezzanine dining overlooking the main stage3 VIP rooms for private diningHand-painted table art by Memphis folk artistLamar Sorrento musician portraits', '$10.00 ', 'bbking_allstar_232437.jpg', 'No', '6', '1', NULL, '0.0', NULL, '0', ''),
