(33145, NULL, 0, 18, 34, 'Corporate University Week 2011', '53', '09:00 AM', '05:00 AM', '', '', 'The Corporate University Best-in-Class Awards CUBICâ„¢ were established to honor  recognize and promote internal training organizations and corporate universities that set standards of ex cellence in a variety of categories. An objective panel of experts and practitioners from the training and development field has been formed to evaluate and score the award applications. Past winners include Fortune 500 companies  small to mid-sized companies  global organizations  non-profits and governmental training groups  so regardless of the size of your organization or your budget  if your organization prides itself on the training and development of its workforce  we encourage you to apply and get the recognition you deserve!', '', 'iqpc_logo_275_100.jpg', 'Yes', '5', '1', NULL, '0.0', NULL, '0', ''),
(33601, NULL, 0, 17, 32, 'Crealde School of Art Classes: Winter Session', '53', '09:00 AM', '04:30 PM', '', '', '&quot;It has always been Crealde&#039;s philosophy and practice to welcome students of all ages and backgrounds into our curriculum of over 80 adult studio courses. In a typical class students range from teens to senior citizens.&Ecirc; This diversity of life experiences makes our classes a richer experience for everyone involved and eliminates the need to separate individuals into specific age groups. Intermediate and advanced level classes (200 and 300 level) have voluntary prerequisites to make students more comfortable with the specific level of learning. Almost half the courses offered are at the beginner level (100) where no previous experience in art is necessary. Through its diverse programming Crealde continues to honor the institution&#039;s original mission by making the visual arts an integral part of community life in Central Florida. This is made possible by offering the rewarding experience of hands-on art education as well as the exposure to quality exhibitions related lectures and the opportunity to work in an environment of professional artists. Every year thousands of individuals of all ages and backgrounds participate in Crealde studio classes and related programs.', 'Free', 'CeramicsSCULPTURE_b_w_small_194028.jpg', 'No', '3', '1', NULL, '0.0', NULL, '0', ''),
(34077, NULL, 0, 18, 34, 'Defense Manufacturing Conference', '53', '09:00 AM', '05:00 AM', '', '', 'The DMC is our nationâ€™s best and largest forum for scientists  technologists  engineers  managers  leaders and policy makers in the defense manufacturing industrial base. The meeting is the product of a pArtnership of the Military DepArtments and Agencies of the DepArtment of Defense. An unprecedented 100% of those who provided solicited feedback from last year''s event said they would not hesitate to attend once again and recommended their colleagues do so as well.', '', 'DMC2011logo.szm200x160.jpg', 'Yes', '5', '1', NULL, '0.0', NULL, '0', ''),
(34554, NULL, 0, 18, 34, 'DEMA - Diving Equipment and Marketing Association Trade Show 2011', '53', '09:00 AM', '05:00 AM', '', '', 'DEMA  the Diving Equipment & Marketing Association  is an international organization dedicated to the promotion and growth of the recreational scuba diving and snorkeling industry.Â Â This non-profit  global Membership-basedÂ organization promotes scuba diving through many initiatives including consumer awareness programs  media campaigns and sponsorship of the DEMA Show  a trade event open only to companies doing business in the scuba diving  action water sports and adventure/dive travel industries.Â  DEMA Show 2011 will take place November 2-5  2011 in Orlando  FL.', '', 'dema.gif', 'Yes', '5', '1', NULL, '0.0', NULL, '0', ''),
(35032, NULL, 0, 16, 53, 'Diddy Dirty Money brings its &quot;Coming Home&quot; tour', '18', '07:00 PM', '11:00 PM', '', '', 'You could be forgiven for thinking that Diddy-Dirty Money was just the latest on an assembly line of aliases for Sean Combs but don&#039;t get it twisted. Though Combs has carefully avoided the use of the word &quot;band&quot; when hyping his new collaboration Danity Kane veterans Dawn Richard and Kalenna Harper do manage to contribute some actual songwriting on &quot;Last Train to Paris&quot; along with the standard duties associated with ladies in the Diddy orbit (sexing up the chorus wearing hot pants).We appreciate that â€” collaboration or no â€” these are some of Combs&#039; most personal jams yet but did he really need to stick his name on the group? Stop taking branding cues from Tyler Perry Diddy. It&#039;s beneath you.Diddy-Dirty Money brings its &quot;Coming Home&quot; tour to the House of Blues on May 1. Tickets are $49-$98 on sale now.', 'Tickets are $49-$98', 'DirtyMoney_181516.jpg', 'Yes', '4', '1', NULL, '0.0', NULL, '0', ''),
(35511, NULL, 0, 18, 34, 'Disaster Management 2011', '53', '09:00 AM', '05:00 AM', '', '', 'It will help pArticipants to understand the nature of global risks  learn risk management strategies to prepare for disruptive events  and identify the best prevention methods in disaster management and public health. It will provide a forum for the exchange of information between leading academics and pArtners in disaster management.', '', 'feb4_disaster.jpg', 'Yes', '5', '1', NULL, '0.0', NULL, '0', ''),
(35991, NULL, 0, 22, 57, 'Disney Live  Mickey&#039;s Magic Show', '21', '05:30 PM', '08:00 PM', '', '', 'Abracadabra! It&#039;s Disney Live! presents Mickey&#039;s Magic Show! Mickey Minnie and a host of Disney friends come together with world-class magicians to perform magic from legendary Disney films right before your eyes. See the Fairy Godmother transform Cinderella&#039;s rags into a beautiful ball gown in a split second; the spectacular levitation of Aladdin&#039;s Princess Jasmine; and the enchanted dancing brooms of Fantasia. Join Donald and Goofy Alice and the Mad Hatter and many more for a one-of-a-kind stage show you&#039;ll never forget. Mickey&#039;s Magic Show is a whole new way to experience Disney Magic with your family!', '$15.00 ', 'mickeys_magic_s_1290655448.jpg', 'Yes', '3', '1', NULL, '0.0', NULL, '0', ''),
