(39875, NULL, 0, 17, 32, 'Expressions in Glass:  Therman Statom&#039;s Caballo Volador Project', '24', '10:00 AM', '04:00 PM', '', '', 'The Caballo Volador Project is a sculpture series created by the renowned studio glass artist Therman Statom at Flying Horse Editions the fine arts press of the University of Central Florida (UCF). The works in the series are boxes constructed of plate glass and filled with evocative images and objects. Many of these visual elements have been used by Statom for years and represent a personal vocabulary of expression. Maps grids vials beakers musical notations and stacks of glass are some of the elements that reflect Statom&#039;s fascination with modes of measuring counting and charting. Such systems represent conventions that combine reason and intuition to describe the world and are perhaps metaphors for the artist&#039;s creative practice.', '8', '30049fbd882b7fa18792eab505f49ea5_191958.jpg', 'No', '3', '1', NULL, '0.0', NULL, '0', ''),
