(67257, NULL, 0, 17, 32, 'Of Cloth and Culture II: African Textiles from the Norma Canelas and William D. Roth Collection', '53', '10:00 AM', '04:00 PM', '', '', 'The ninth in a series of exhibitions drawn from the Norma Canelas and William D. Roth Collection of African Art this exhibition features 45 extraordinary examples of textiles and beadwork from a number of regions of the African continent. Highlights include a colorful Kente cloth of West Africa beautifully beaded aprons of the Kirdi in Cameroon a Zulu wedding cape and embellished animal skins of the San people of South Africa as well as a number of stunning beaded crowns and headdresses of the Yoruba people of Nigeria. The Roth Collection has been recognized by Art and Antiques Magazine numerous times as one of the top 100 art collections in America.', 'Free', 'a3af5fc32a56b2cd61851daf20dc239e_192928.jpg', 'No', '3', '1', NULL, '0.0', NULL, '0', ''),
