(69180, NULL, 0, 21, 39, 'Orlando Magic vs. Charlotte Bobcats', '53', '07:00PM', '', '', '', '"The Orlando Magic is a professional basketball team based in Orlando   Florida. They play in the Southeast Division of the Eastern Conference of the National Basketball Association (NBA) and are currently coached by Stan Van Gundy. The franchise was founded in 1989 as an expansion franchise and has had such notable NBA stars such as Shaquille O''Neal   Penny Hardaway   Grant Hill   Tracy McGrady   Steve Francis   Dwight Howard   Hedo Turkoglu   Vince Carter    Gilbert Arenas and Rashard Lewis throughout its young history. The franchise has also been in the playoffs for more than half of their existence (12 playoff appearances in 21 years). Orlando has been the most successful of the four expansion teams brought into the league in 1988 and 1989 in terms of winning percentage. As of 2010   they are the only team in the ""big four"" sports leagues to play in the city of Orlando."', 'Starting at $36.00', 'MAGIC_cal_vsbobcats_1.jpg?1281729559', 'Yes', '3', '1', NULL, '0.0', NULL, '0', ''),
