(84512, NULL, 0, 16, 46, 'Sacred Slave Stories', '21', '07:30 PM', '10:00 PM', '', '', 'Their voices still echo in time...ordinary people catapulted into a violent journey that forever changed the history of our world. And now Moore Dance Project brings their true experiences to the stage with Sacred Slave Stories a contemporary ballet inspired by some of the most compelling interviews with more than 2000 formerly enslaved African-Americans as documented by the Federal Writers&#039; Project (1936-1938). Featuring narrated excerpts from 25 of these historic interviews Sacred Slave Stories unfolds as a series of living memories that reveal deeply personal accounts of a people&#039;s collective courage sacrifice and resilience. But even greater than its apparent tragedy Sacred Slave Stories resonates with profound hopeÃ¢â‚¬â€and relentless joyÃ¢â‚¬â€to accurately portray the humanity of those who refused to be diminished by an unjust world.Narrated by film actor Harry Burney; appropriate for all ages.', '$15.00 ', 'sacred_slave_st_1297485417.jpg', 'Yes', '3', '1', NULL, '0.0', NULL, '0', ''),
(85211, NULL, 0, 16, 53, 'Sade with special guest John Legend', '53', '8:00PM', '', '', '', 'Following the platinum selling success of Soldier of Love   Sade announces their highly anticipated return to the worldâ€™s stage. Sade will perform songs from their collection of timeless hits including songs from their critically acclaimed album   SOLDIER OF LOVE which secured the # 1 album spot upon its release in February. Selling over a million copies to-date   SOLDIER OF LOVE spent three weeks in the number one spot taking its rightful place among the collection of iconic Sade albums. Not only has America welcomed Sade back with open arms after close to ten years   but worldwide   SOLDIER OF LOVE has proven to be a smash. The album skyrocketed to # 1 in ten additional countries including Canada   Switzerland   France   Italy   Poland   Greece   Japan   Portugal and Spain. Entertainment Weekly featured SOLDIER OF LOVE in their â€œMust Listâ€ and gave the album an â€œAâ€   Rolling Stone wrote   â€œitâ€™s unimpeachably excellent  â€ and The Boston Globe calls it   â€œa rich and rewarding album.â€ ', '', 'AC_cal_sade.png?1291052948', 'Yes', '5', '1', NULL, '0.0', NULL, '0', ''),
