(101107, NULL, 0, 18, 34, 'The Solutions Event - ISS Imprinted Sportswear Show Orlando', '53', '09:00 AM', '05:00 AM', '', '', 'In addition to the traditional ISS exhibitors who feature screen printing and embroidery equipment  ink supplies and materials  the Solutions Event will also bring together retail pavilion suppliers such as packaging  tagging and display fixtures. The will also be a business pavilion with exhibitors such as financing and business services who can provide solutions for your business. The ISS shows have focused exclusively on the imprinted decorated apparel industry for over 30 years. Our pArtnership with Impressions Magazine make us unique to this dynamic industry. The trade show brings together buyers  suppliers  manufacturers and industry leaders in regional setting to explore screen printing  embroidery  sublimation  graphic design and digital printing. Workshops and sessions are provided to showcase new technology and techniques with top industry leaders.', '', 'display.php?id=169', 'Yes', '3', '1', NULL, '0.0', NULL, '0', ''),
