(102598, NULL, 0, 17, 32, 'Third Thursday Gallery Hop', '53', '10:00 AM', '05:00 PM', '', '', '&quot;Strap on your walking shoes and channel your inner Picasso during tonight&#039;s Third Thursday Gallery Hop.  Culture buffs can meet-the-artists  sip some wine  and stroll through the streets of the Downtown Arts District to enjoy dozens of art openings  live performances  and outdoor soirees.  While the Gallery Hop offers food for thought  nearby eateries offer food for the senses.  Though many shops are open earlier  the Gallery Hop officially starts at 6:00 p.m. and runs to 9:00 p.m.  with restaurants and bars staying open considerably later. Park at the Plaza parking garage and stop by CityArts Factory&Otilde;s reception desk and they&Otilde;ll validate your parking at a flat rate of $4 for the whole evening!  The Gallery Hop is made possible with generous support of Kiene/Quigley. Beverages are generously provided by City Beverages.&quot;', 'Free', 'Third Thursday Gallery Hop_204550.jpg', 'No', '6', '1', NULL, '0.0', NULL, '0', ''),
(103346, NULL, 0, 17, 32, 'Thorton 3rd Thursday Art Walk', '53', '06:00 PM', '09:00 PM', '', '', 'The 3rd Thursday of every month  visitors gather for the Thornton 3rd Thursday Art Walk. They come to celebrate art and partake in an evening of sights  sounds  food  shopping  and cosmopolitan fun.  On a typical Thornton 3rd Thursday Art Walk  non-traditional art venues (think restaurants  boutiques  and salons) spotlight the best of established and emerging Orlando-based artists. Expect the unexpected as each month is uniquely an experience in art and culture.  The stroll is on E. Washington Street to N. Summerlin Avenue and to Central Boulevard.&Ecirc; Basically from Graffiti Junction to Hue Restaurant and ALL the places in between!  Though many shops are open earlier  the Thornton 3rd Thursday Art Walk officially starts at 6:00 p.m. and runs to 9:00 p.m. with restaurants and bars staying open considerably later.  Parking:  Thornton Park Parking Garage with entrances on North Eola Drive and East Washington Street. Street parking is available if you can find it.  See you at the Thornton 3rd Thursday Art Walk!', 'Free', 'Thorton 3rd Thursday Art Walk_204310.jpg', 'No', '7', '1', NULL, '0.0', NULL, '0', ''),
