(108613, NULL, 0, 19, 26, 'Vintage Lounge', '22', '09:30 PM', '02:00 AM', '', '', 'Vintage is billed as Orlando&#039;s premier dance lounge and laid back happy hour.Vintage Lounge - a Downtown Underground Music-Vino-Libation-Collaboration- is actually better than that: a dark Classic-themed space with antique chandeliers eighteen foot gold crown ceilings red-velvet drapes and cozy nooks to get intimate with over martinis and the girl or guy you meet at the bar. It&#039;s been around for years now but the drinks only get better the DJs are among the best in town along with the sophisticated professional crowd.Don&#039;t forget Thursdays is Ladies Nite at Vintage Lounge and Vixen Bar with Free Martinis and Drinks all night long.Vintage Lounge has hosted numerous fashion shows and photo shoots celebrity parties music videos backdrop for two reality shows four commercials the background of CD covers and the location of several Launch parties. The Vintage Lounge has won virtually every local paper award as well as placed first in one of Ch 2&#039;s coveted &quot;A-List&quot; categories.', '$10.00 ', 'slide1_085932.jpg', 'No', '6', '1', NULL, '0.0', NULL, '0', ''),
