(110923, NULL, 0, 16, 46, 'Wicked the Musical', '21', '02:00 PM', '04:00 PM', '', '', 'Long before that girl from Kansas arrives in Munchkinland two girls meet in the land of Oz.  One - born with emerald green skin - is smart fiery and misunderstood.  The other is beautiful ambitious and very popular.  How these two grow to become the Wicked Witch of the West and Glinda the Good makes for Ã¢â‚¬Å“the most complete - and completely satisfying - new musical in a long timeÃ¢â‚¬Â (USA Today).On Broadway and around the world WICKED has worked its magic on critics and audiences alike. Winner of 35 major awards including a Grammy&reg; and three Tony&reg; Awards WICKED is Ã¢â‚¬Å“BroadwayÃ¢â‚¬â„¢s biggest blockbusterÃ¢â‚¬Â and Ã¢â‚¬Å“the defining musical of the decadeÃ¢â‚¬Â (The New York Times).', '$39-$75', 'wicked_201516.jpg', 'No', '3', '1', NULL, '0.0', NULL, '0', ''),
(111698, NULL, 0, 19, 24, 'Wine Tasting at Maggie&#039;s Attic', '53', '06:00 PM', '08:00 PM', '', '', 'Occurring every first and third Saturday of the month Wine Tastings at Maggie&#039;s Attic in scenic Mount Dora offer up a unique night for anyone that stops in. Along with light appetizers Maggie&#039;s Attic offers a variety of over 400 different wines and a large beer selection from around the world. Beer and Wine Club members get in free and non-members only pay a $15 cover charge for entry. While you&#039;re at Maggie&#039;s swing in to their one-of-a-kind gift shop where one can find the most eclectic gifts in Central Florida including mix-and-match 6-packs from around the globe that you get to create! The next tasting is Saturday March 5th from 6PM until 8PM. For more information on Wine Tastings at Maggie&#039;s Attic please visit www.maggiesattic.us or call 352-383-5451.', '$15.00 for Non-Members', 'Maggies Attic_201207.jpg', 'No', '6', '1', NULL, '0.0', NULL, '0', ''),
(112474, NULL, 0, 17, 32, 'Winter Park Side Walk Art Festival', '22', '09:00 AM', '05:00 AM', '', '', 'Both local and national talent abound at the annual Winter Park Sidewalk Art Festival held every March in Central Park along Park Avenue. Recognized as one of the nation&#039;s most prestigious art festivals this Central Florida favorite draws more than 350000 visitors each year. The beauty of Winter Park&#039;s posh Park Avenue along with pleasant March weather encourages Central Floridians to partake in the three day festival showcasing both amateur and professional wares.', '$0.00 ', 'wp-sidewalk-art-festival-inlineImage_03_092539.jpg', 'No', '3', '1', NULL, '0.0', NULL, '0', ''),
