(113254, NULL, 0, 17, 32, 'Artists & Authors Series: All the Presidentsâ€™ Pastries with Chef Roland Mesnier', '53', '8:00 PM', '', '', '', '"Enjoy dinner as Roland Mesnier shares stories from his 26-year tenure as White House pastry chef. Working for the administrations of Jimmy Carter through George W. Bush  Chef Mesnier created countless perfect desserts for the First Families and their distinguished guests. Reception with Chef Mesnier at 6:30 p.m. Dinner and program at 7 p.m.  followed by a book signing. $50 Members  $65 non-members. Table pricing available. Call (407) 836-7010 to reserve a seat.\n"', '$50:00 to 65:00', 'adjusted_774-5.jpg', 'No', '3', '1', NULL, '0.0', NULL, '0', ''),
