(113259, NULL, 0, 19, 24, 'Lil Wayne with Nicki Minaj  Rick Ross', '53', '6:00PM', '8:00PM', '', '', 'Sometimes  if you put your hand on the rails  you can feel the train coming. It''s in the air  on the tip of everyone''s tongue. All there is to do is patiently wait. Every once in a while an artist comes along with the force of a natural element and the only thing you can do is get aboard or get out of the way. So  from the good people who brought you the Roc-A-Fella dynasty  the Snowstorm and the College Drop and Take a look at the confidence  sex appeal and lyrical strength of Nicki Minaj  and itâ€™s no wonder that Lil Wayne wanted her to be the face of Young Money. Singing hooks for other artists early on  the Queens nativeâ€™s career as an emcee started about a year ago. Fendi  the CEO of Brooklyn label Dirty Money Records  heard the tracks on Nickiâ€™s MySpace page and had to contact her to put her on his The Come Up DV. and Lil Wayne Tha Carter II Although there has been much debate on the subject of who is or who isn''t the King of the South  Lil Wayne isnt worried about all the fuss as to who really lays claim to the title. As a veteran rap star  budding entrepreneur  and young scholar studying psychology at the University of Houston  Wayne''s experience in the rap game  coupled with his amazing growth as an individual has place...', '', 'adjusted_020-8.jpg', 'No', '6', '1', NULL, '0.0', NULL, '0', ''),
