(113274, NULL, 0, 19, 24, 'Lauryn Hill', '53', '6:00PM', '8:00PM', '', '', 'Lauryn Hill is an American recording artist  musician  producer and actress. Early in her career  she established her reputation as a member of the Fugees. In 1998  she launched her solo career with the release of the commercially successful and critically acclaimed album  The Miseducation of Lauryn Hill. The recording earned Hill five Grammy Awards  including the coveted Album of the Year and Best New Artist..', '', 'adjusted_441-9.jpg', 'No', '6', '1', NULL, '0.0', NULL, '0', ''),
(113281, NULL, 0, 19, 24, 'Chillounge Night', '28', '6:00PM', '8:00PM', '', '', 'Experience a South Beach vibe at Lake Eola Park when its transformed into an outdoor lounge complete with draped contemporary furnishings and daybeds  body paint and fashion shows  live samba  jazz  tango and flamenco music  a fireworks display  cigar lounge area  food vendors and cash bars. The soiree will take place across from Panera Bread in the park. The dress is evening casual. The VIP area accommodates 350-400 people and includes an open liquor bar and complimentry food and a cigar. Partial proceeds will benefit the Fatone Family Foundation', '$20.00 ', 'Chill-Lounge-splash_logo.jpg', 'No', '6', '1', NULL, '0.0', NULL, '0', ''),
