(113578, NULL, 0, 19, 25, 'Tim McGraw with The Band Perry  Luke Bryan', '53', '7:30 PM', '', '', '', 'When it came time to record his new record  Live Like You Were Dying  Tim McGraw knew just what he wanted. He was  after all  coming off the extraordinarily successful Tim McGraw and the Dancehall Doctors  which he and his longtime touring band had recorded in a mountaintop studio in upstate New York. The natural and creative atmosphere  the isolation that allowed them to concentrate fully on the music  and t..& Singer and songwriter Luke Bryan comes by his country influences naturally -- he grew up in Leesburg  GA  a small town 100 miles from the Alabama border where his father grew peanuts and sold fertilizer for a living. Bryan helped his family work the farm when he was young  but in his early teens he developed a passion for country music  picking up his influences from his parents'' record collection  listening ... (Luke Bryan tour dates and bio) ', '', 'adjusted_526-8.jpg', 'No', '5', '1', NULL, '0.0', NULL, '0', ''),
(113604, NULL, 0, 19, 25, 'James Taylor', '53', '8:00 PM', '', '', '', 'James Vernon Taylor (born March 12  1948) is a Grammy Award winning American singer-songwriter and guitarist born in Boston  Massachusetts  and raised in Carrboro  North Carolina.[1] He currently owns a home in Berkshire County  Massachusetts. Taylor''s career began in the mid-1960s  but his commercial and critical breakthrough came with the 1970 album Sweet Baby James  a collection of sensitive and introsp', '', 'adjusted_195-0.jpg', 'No', '3', '1', NULL, '0.0', NULL, '0', ''),
(113631, NULL, 0, 19, 25, 'Yanni', '53', '7:30 PM', '', '', '', 'Yanni (born Yanni Chryssomallis on Nov. 14  1954 in Kalamata  Greece) is a self-taught pianist  keyboardist  and composer. Yanni left his homeland at the age of 18 to attend the University of Minnesota. After receiving a B.A. in psychology  he would instead seek a life in music though he had no formal training and could not read a note. After playing keyboards in local rock bands such as Chameleon  he moved t...', '', 'adjusted_526-1.jpg', 'No', '5', '1', NULL, '0.0', NULL, '0', ''),
