(114044, NULL, 0, 18, 35, 'It''s All in Good Taste- Benefit for B.A.S.E Camp at Orlando Tastings', '53', '8:00 PM', '', '', '', '"Benefit to raise money for B.A.S.E. Camp  a Children''s Cancer Foundation. You will receive a $10 Tastings Wine Card with your $15 min donation to B.A.S.E. Camp. www.basecamp.org BASE Camp provides a year-round base of support for children and families who are facing the challenge of living with cancer and other life-threatening hematological illnesses. We serve not only the children who are patients  but their brothers and sisters too. RSVP to Robert Mackey at RobertDMackey10@gmail.com\n"', '$10:00 to 15:00', 'fundraisers.jpg', 'No', '5', '1', NULL, '0.0', NULL, '0', ''),
