(114516, NULL, 0, 19, 25, 'Murs W/ Dj Foundation', '53', '8:00 PM', '', '', '', '"A longtime friend of Definitive Jux leader El-P  rapper Murs first appeared as a solo artist in 2003  after nearly a decade of working with various groups in the underground. Based in Los Angeles  his first single was released in 1993  and came from a self-released album by his first group  3 Melancholy Gypsies. The track barely made a dent  but it did catch the attention of indie hip-hop fans in the area. Through time  the group members became friends with Mystik Journeymen  who asked 3MG (their shortened name) to join him when he started the Living Legends collective in 1996. Between both 3MG and the Living Legends  Murs rapped on several influential indie rap albums  appearing on more than 20 records  EPs  and singles within a seven-year period. When El-P started to pull together his Def Jux label  Murs contacted the producer and told him he would release his solo record for the company once he had the opportunity. His commitments to both the Legends and 3MG often kept him from working on the album  but after a few years of slowly putting together tracks  Murs finally delivered The End of the Beginning in the spring of 2003. Featuring flashier production than his group projects  the album was more in tune with a mainstream hip-hop record  though projects with Anticon rapper Slug under the name Felt -- A Tribute to Christina Ricci and A Tribute to Lisa Bonet -- unveiled a more experimental side to his artistry. The rapper returned to solo work with Murs 3:16: The 9th Edition  a collaboration with producer 9th Wonder  in 2004. One of the tracks from that album  ""Walk Like a Man "" inspired a movie starring Murs himself  along with Damien Wigfall. The soundtrack  Walk Like a Man  also appeared in mid-2005. Murs teamed up again with 9th Wonder to release Murray''s Revenge in 2006. ~ Bradley Torreano  All Music Guide"', '', '231752_470-50x250-50_2.jpg', '', '5', '1', NULL, '0.0', NULL, '0', ''),
(114528, NULL, 0, 19, 24, 'Sharon Jones and The Dap-Kings', '53', '7:00 PM', '', '', '', 'Sharon Jones was born Sheron Lafaye Jones in Augusta  Georgia on May 4th 1956. Her mother moved to Brooklyn soon thereafter  however Jones was sent down south for a few months every year to stay with her family. As a child  she and her brothers would imitate the songs and dances of James Brown  who shared their hometown. Like many rhythm and blues entertainers  she began performing in church at a very young age where her voice would find a lifelong home and inspiration. As a teenager in the early nineteen seventies  she began singing outside of the church in talent shows and with local funk groups. Later she would make her living with a combination of sporadic session work as a mostly anonymous voice on various dance records (sometimes credited as Lafaye Jones)  singing with wedding bands  and a handful of day jobs which included stints as both a prison guard at New Yorkâ€™s notorious Rikerâ€™s Island  and an armored car guard for Wells Fargo Bank. In 1996 she was called in to sing back-up at a Desco Records studio session for 70â€™s soul legend Lee Fields.Desco was a small independent specializing in traditional funk and soul pressed exclusively to wax. Co-owners and producers Phillip Lehman and Bosco â€˜Bassâ€™ Mann had called Jones in on a tip from a sax player who was seeing her at the time. As the other two girls never showed up for the session  Jones cut all the background parts for the session herself  and proceeded to cut the impromptu prison rap over Switchblade  which had originally been intended for a man. Ironically  that rant (slowed down to make it sound like a man) would be her first outing as a featured artist on a record. Though she was at first skeptical of the 21 year-old jewish kid egging her on from the other side of the glass  a common love and respect for Soul music soon created a trust and friendship between Jones and Mann which would lead them both to a fruitful career.Over the next four years  Jones sang frequently alongside Lee Fields  Joseph Henry  and Naomi Davis as part of the Desco Super Soul Revue backed by Desco house band the Soul Providers. Desco would release a handful of singles in her name including The Bump & Touch  Damn Itâ€™s Hot  and You Better Think Twice as well as versions of funk classics I Got the Feelinâ€™ and Hook & Sling. In the UK  a blossoming Deep Funk scene lead by DJâ€™s Keb Darge and Snowboy among others showed support for these Desco releases and paved the way for Jones and the Soul Providersâ€™ first international tour in 1999  where her command of the stage earned her an overnight title as the â€˜Queen of Funkâ€™.Unfortunately  just as the Jones and the band began to gain momentum and a reputation for a show that couldnâ€™t be missed  internal business conflicts caused the demise of Desco Records in the early part of 2000. Though the Soul Providers would not perform again  it wasnâ€™t long before Jones and Mann would regroup in another formation.Guitarist Binky Griptite  would remain at Mannâ€™s side as well as organist Earl Maxton  percussionist Fernando â€˜Boogalooâ€™ Velez  trumpeter Anda â€˜Goodfootâ€™ Szilagyi and Baritone saxophonist Jack Zapata (AKA MartÃ­n Perna  who would go on to form Brooklyn afrobeat collective Antibalas) all from the original Soul Providers. From the Mighty Imperials  a young instrumental organ funk group that recorded at Desco  Tenor saxophonist Leon Michels (who would later leave the group to form the El Michels Affair as well as his own label  Truth & Soul) and drummer Homer â€˜Funkyfootâ€™ Steinweiss would fill out the line-up. Both were only 17 years-old at the time. Now for the first time  the group would be billed as Sharon Jones & the Dap-Kings.In 2001  the group landed a summer residency at a club in Barcelona. Knowing that the trip would be a financial disaster without having a recording to sell  Mann penned a few new tunes and assembled the band to record. A rough eight track recording studio was rigged up in the basement beneath the Afro-Spot  a local kung-fu dojo which doubled as an afrobeat nightclub and headquarters for Antibalasâ€™ frontman Duke Amayo. After a few weeks of tracking and mixing  the bandâ€™s debut album was completed. Dap Dippinâ€™ with Sharon Jones & the Dap-Kings would be Jonesâ€™s first full length recording. Though few hundred copies were pressed to sell on the road  it would take several months and the birth of a new record label before Dap-Dippinâ€™ would be commercially released.In late 2001  saxophonist Neal Sugarman  whose organ driven Sugarman Three combo had given Desco two of its most prominent releases  and Gabriel Roth  Descoâ€™s head recording engineer  joined together to form Daptone Records. With the intention of continuing on where Desco had left off  Daptoneâ€™s debut release would be the Dap-Dippinâ€™ album.Over the next three years  Sharon Jones & the Dap-Kings would tour extensively and build steadily upon a growing reputation as the unrivaled frontrunners of old-school Soul and Funk music. The band went through several changes in personnel before settling into what would be its permanent line-up. Sugarman joined the band to replace Michels on tenor saxophone. Michels would move to baritone where he would stay until 2005  when he eventually left to give Truth & Soul Records his full attention. He would be replaced on baritone by Ian Hendrickson-Smith  a well known and respected jazz saxophonist in his own right. The trumpet chair passed from Szilagyi to Todd Simon  and was eventually filled by David Guy. Maxton left the band in 2003 to play with Antibalas  leaving the band with no organ  and guitarist Tommy â€˜TNTâ€™ Brenneck  of the Budos Band  would take up the slack in the rhythm section.By the time they returned to the studio in 2004  the Dap-Kings roster read like a veritable whoâ€™s who of the dayâ€™s Soul and Funk scene  most of whom were bandleaders in their own right. Countless gigs had molded the rhythm section into a redoubtable juggernaut on the bandstand  and the combination of Sugarman  Guy  and Hendrickson-Smith in the horn section was fierce. Behind the ever-increasing power and stage presence of Jones  the band was becoming a force to be reckoned with.In 2003  Daptone Records had relocated to a dilapidated two family house in Bushwick  Brooklyn. Upstairs became the offices  and with some amount of work  the first floor had been converted to a recording studio. By the time the Dap-Kings came to record their second record in March of 2004  the studio had been outfitted with a sixteen track tape machine. (Originally  the plan was to record the second and third albums back to back. Unfortunately  on the last day of tracking the second record  a car accident on the way home from the studio landed Mann in the hospital with serious eye injuries. From then on he would have to wear protective sunglasses. It was over a month and a half before work could be resumed on the album and it was decided to scrap the third album for the time being.)In January of 2005  Naturally hit the streets and set Jones and the Dap-Kings loose on a relentless touring schedule. Fueled by rave reviews of both their new record and the blistering live show  record sales and concert attendance began rising across the country  and as the band began to tour more frequently overseas  international markets soon followed suit. By 2006  audiences in Europe  Canada  and Australia were packing venues to see Sharon Jones & the Dap-Kings.A high point came when Daptone Records presented a Soul Revue at New Yorkâ€™s Irving Plaza (Fillmore East) to honor Jonesâ€™ 50th birthday. The sold out extravaganza featured The Mighty Imperials  The Budos Band  Charles Bradley  Binky Griptite  Naomi Davis & the Gospel Queens  the Bushwick Philharmonic  Antibalas  and was of course headlined by the Dap-Kings and Sharon Jones herself. ', '', '965549_470-50x250-50_2.jpg', '', '6', '1', NULL, '0.0', NULL, '0', ''),
