(114570, NULL, 0, 19, 25, 'Sharon Jones & The Dap-Kings - Peter Baldwin ', '53', '7:00 PM', '', '', '', '"Sharon Jones and the Dap-Kings have come a long way since their humble beginnings nearly a decade ago. Steeped within the gilded and gritty sounds of gospel  soul and funk  this nine-piece Brooklyn collective has continued to electrify fans  disc jockeys  critics  record collectors  and bloggers the world-over with their authentic  heart-felt sound. The authenticity clearly demonstrated on the bandâ€™s three critically-acclaimed albums â€“ Dap Dippinâ€™ (2002)  Naturally (2005) and 100 Days  100 Nights (2007) â€“ captured and released by the independent Daptone Records. Their albums recall an analog era led by iconic studios like those at Motown and Stax Records  and have thrust the fifty-three-year-old Augusta  GA native and crew into the multimedia limelight.\n\nSharon Jones and the Dap-Kings have appeared on CNN  Good Morning New York  MTV News  VH1  Conan Oâ€™Brien  Craig Ferguson  David Letterman  Jimmy Fallon  BBC Television  NPR radio shows like Morning Edition and Fresh Air with Terry Gross  and have been covered in a slew of publications  from personal blogposts all the way to feature stories in the New York Times Sunday Magazine  Newsweek  the Associated Press  Interview  the Village Voice  and Entertainment Weekly.\n\nAs distinguished as their recordings may be  however  Sharon Jones and the Dap-Kings have truly become renowned thanks to their incredible live show  not to mention their relentless touring. And though itâ€™s certainly no easy task to keep such a vast ensemble on the road  the band continues to pack hundreds of clubs worldwide  from legendary venues like New Yorkâ€™s Apollo Theater  Beacon Theater and Central Parkâ€™s SummerStage to their show-stopping sets at Coachella  Lollapalooza  Roskilde  Bonnaroo  Austin City Limits and WOMAD."', '', 'music.jpg', '', '5', '1', NULL, '0.0', NULL, '0', ''),
(114587, NULL, 0, 19, 23, 'Tini Tuesday', '54', '5:00 pm ', ' 2:00 am', '', '', 'Host Sassy Devine will be offering $2 martinis from 8pm until midnight and Troy David spearhead karaoke with a weekly prize of $100 and a grand prize of $500. 21 and over please.', '$5 ', 'images%3Fq%3DTini%2BTuesday%26um%3D1%26hl%3Den%26client%3Dfirefox-a%26sa%3DN%26rls%3Dorg.mozilla:en-US:official%26biw%3D1366%26bih%3D608%26tbs%3Disch:1&um=1&itbs=1&iact=hc&vpx=328&vpy=93&dur=388&hovh=', '', '6', '1', NULL, '0.0', NULL, '0', ''),
(114605, NULL, 0, 19, 24, 'Gordon Lightfoot', '53', '8:00 PM', '', '', '', '"Gordon Lightfoot was born on November 17  1938 in Orillia  Ontario  Canada. His parents recognized and encouraged his interest in music  his first appearance as Massey Hall in Toronto  now a revered standard in his tour schedule  was just before he turned 13  as the winner of a competition for boys with unchanged voices.\n\nAfter a background in barbershop quartets  and as a member of a duo  Lightfoot struck out on his own in the early 60s. He had written perhaps 75 songs  when he was caught up in the country music scene and folk revival of the time  Bob Dylan''s music and a song by Merle Travis  Dark As A Dungeon  combined with his sensitivity  inventiveness and beautiful voice  resulted in his unique songwriting and singing style. In less than two years  between late ''61 and some time in 1963  his sound and his life changed forever. For more about this early period in Lightfoot''s career  read the article Early Lightfoot. "', '', '731518_470-50x250-50_2.jpg', '', '6', '1', NULL, '0.0', NULL, '0', ''),
