(117096, 131345790269946, 149167491791333, 19, 23, '|| PAUL KALKBRENNER || Sab 16.04 HANGAR - JokerEventiRoma 320.3344093', '22', '10:00 PM', '06:00 AM', '', '', 'Sabato 16 Aprile 2011 \n\nJoker Eventi Roma con la collaborazione di\nELITA FESTIVAL & MAGAZZINI GENERALI presents \n\n\n\n/// PAUL KALKBRENNER in concert //////////// \n\n\n+ ART DEPARTMENT \n\n+ FALTY DL \n\n\nApertura porte Ore 21\nInizio Ore 22\nIngresso agevolato per chi acquista la PREVENDITA! \n\n\n\n:::: INFORMAZIONI & CONTATTI ::::\nGIORGIO\ncell. 320.3344093\nemail: giopas89@live.it\n\nFacebook Profile\nGiorgio Passos\nhttp://www.facebook.com/Giorgio.JokerEventi\n\nFacebook Official Event Page\nJoker Eventi roma\nhttp://www.facebook.com/pages/Joker-Eventi-Roma/149167491791333\n\nJoker Eventi Roma CocoricÃƒÂ² Official Group\nhttp://www.facebook.com/home.php?sk=group_132599130138746\n\n\n-------------------------------------------------------------------------------------\nSabato 16 Aprile appuntamento imperdibile con la collaborazione tra ELITA FESTIVAL & MAGAZZINI GENERALI che presentano nella location post-industriale degli Hangar Bicocca di Milano un party che passerÃƒÂ  alla storia! \nIl piÃƒÂ¹ grosso fenomeno dance mondiale del 2010 arriva da Berlino e si chiama PAUL KALKBRENNER! \nAttualmente i suoi concerti stanno registrando il Sold Out in tutta Europa. Il suo sound originale e melodico muove le masse ed il 16 aprile infiammerÃƒÂ  l''Hangar Bicocca! \n\nAlla base del succeso di PAUL KALKBRENNER cÃ¢â‚¬â„¢ÃƒÂ¨ unÃ¢â‚¬â„¢attivitÃƒÂ , tra produzioni musicali e live act, di 15 anni. Quando il muro di Berlino crollÃƒÂ² Paul aveva 12 anni. La colonna sonora di quei giovani e della maggior parte della sua generazione era la techno music. \nAlla fine dellÃ¢â‚¬â„¢adolescenza Kalkbrenner inizia una serie di esibizioni come dj, spesso a fianco dellÃ¢â‚¬â„¢amico Sascha Funke, che lo portano col tempo a concentrarsi in studio sulla produzione di musica propria. Il suo debutto discografico avviene nel 19