(117143, 100621700019357, 749913746, 19, 23, 'Diddy Dirty Money Coming Home Tour Orlando', '25', '08:00 PM', '11:00 PM', '', '', 'BET LIVE | CIROC | THE FIRM PRESENTS \n\nDIDDY DIRTY MONEY LIVE IN CONCERT AT THE ORLANDO HOUSE OF BLUES FOR THE COMING HOME TOUR!\n\nThe Last Train to Paris is pulling into intimate venues across the United States - Don''t miss this concert event!\n\nAlong with Performances by Tyga & Lloyd!\n\nGet your tickets at all Ticketmaster locations - charge by phone by calling 800.745.3000 or www.ticketmaster.com\n\nSponsored by Barnes Supply Orlando :: www.barnessupplyorlando.com\n\nMusic before the concert is brought to you by:  \nDJ Pointblanc | DJ Grinz | DJ Caesar \n\nMore information coming soon so stay tuned!\n\n\n', '0', '100621700019357_749913746.jpg', 'No', '5', '0', '2011-03-14', '0.0', '0000-00-00', '0', 'admin'),
