(117149, 185687391473217, 1782405377, 19, 23, 'STUPID GENIUS/SOUTHCOASTRECORDS Album release party', '25', '08:00 PM', '11:00 PM', '', '', 'SOUTH COAST ENT. presents:  STUPID GENIUS album release party.\nSunday April 3rd Early show. 8-11\nKABBAB''S HOOKA LOUNGE  next door to Tessa''s and Tavern on the lake.\nHOSTED by JAY LOVE with 102JAMZ\nMUSIC by DJ NIECY D\nSHOW STARTS at 8pm\nYes there will be Hooka''s and everybody is V.I.P.\nDrink specials all night.\nStarting with SHAITARA (Belly dancer)(Crazy fire show)(She''s fine to) \nWe were blessed to get these two very talented artist: \nSpecial performances by: ATIBA                        \nSpecial performances by: CES\nTheir contact is\n www.fmamrecordings.com\n  fmamrecordings.info@gmail.com\nSpecial appearances by : Other South Coast artist all blessing the stage.\nNATURAL VIBES \nJAY FRESKO\nAN ONE\nMEGGA NEENZ\nSpecial appearance by :\nConscious minds recording artist SOCIETY''S POET---  with special words for Stupid Genius\nand of course, STUPID GENIUS PERFORMING HIS NEW SINGLE AUTOMATIC on the South Coast recording label.\nThis will be an early event so make sure your on time.8pm You don''t want to miss any of this show, it''s gonna be a classy night so dress nice and bring your love for real music.\nSee you there friends', '0', '185687391473217_1782405377.jpg', 'No', '5', '0', '2011-03-14', '0.0', '0000-00-00', '0', 'admin'),
