(117163, 197314436965197, 10083422212, 19, 23, 'Avicii @ Venue', '25', '10:00 PM', '03:00 AM', '', '', 'SUNSET, NOCTURNAL, MUSIC OWNS ME and THE VENUE present \n\nSuperstar Dj and Producer "AVICII" LIVE @ The VENUE!! SATURDAY, MARCH 19th!!! 18 & Up\n\nFor his first ever Tampa appearance!!!!!!!!!!!!!!!!!\n...\nPre-Sale Tickets Here:\nhttp://www.wantickets.com/Events/ShowEvent.aspx?eventId=87396\n\nBio:\nAvicii had only been producing a few months when his friends noticed that the productions were amazingly professional and that they had just witnessed a great talent being born. Avicii started out with doing a remix of the theme music for the Commodore 64 game Ã¢â‚¬ËœLazy JonesÃ¢â‚¬â„¢, but decided to drop it as it inspired him to make his own Ã¢â‚¬ËœLazy LaceÃ¢â‚¬â„¢ Ã¢â‚¬â€œ released almost immediately on Strike Recordings.\nAvicii was instantly fascinated with producing and spent many hours in his home studio creating one fresh tune after the next. Avicii never tried to get caught up in a specific subgenre of house, but wanted to keep the productions up to date and innovative. His music is inspired by the likes of Laidback Luke, Steve Angello and Tocadisco, but also Daft Punk, Eric Prydz and that of Axwell. In April 2008, Avicii released the first big track, Ã¢â‚¬ËœManmanÃ¢â‚¬â„¢, on Pete TongÃ¢â‚¬â„¢s Bedroom Bedlam label after winning the Pete Tong Fast Trax. Avicii received an astonishing 70% of the votes and after the release and were contacted by numerous labels, promoters and booking agencies from all over the globe. Even Laidback Luke mentioned Avicii on his Myspace website saying: Ã¢â‚¬Å“[Avicii], by winning this competition, left many contesters behind in their dust. / So a big CONGRATULATIONS to these brilliant DJs for winning the contest and all the luck with their future careers!Ã¢â‚¬Â\nWhat Avicii wants is to create music for people to listen to and come to love, whether it be at home or in a dark nightclub. Avicii puts great emphasis on melodies in his productions and wants to appeal to fans of many different house music genres. Avicii signed on to At Night Management in May 2008 and within a month the buzz around them spread noticeably and they were recognized on labels such as Joia Records, Vicious Grooves and Ministry of Sound, just to name a few. By the end of that month, Avicii had already signed a big deal with Vicious Grooves in Australia and were head on target to soon explode over the entire globe.\nAvicii is currently appearing on selected international DJ gigs but otherwise locked up in the studio, always experimenting with new sounds in order to bring out original cool tracks and to grow as producers.\nMore recently, the 19 year old producer has been VERY busy in the studio. With his first single (Sound of Now) and follow up EP (Muja/Record Breaker) off the shelf, remixes for D.O.N.S., Roger Sanchez, as well as Jose Nunez, Richard Grey & Erick Morillo and with upcoming mixes for Livin Joy, Phonat, Little Boots, Paul Thomas and Tim Berg Ã¢â‚¬â€œ just to mention a few. Among more of his own releases, Avicii broke ground in 2009 with his third release and original track RyÃƒÂ¹, which was charted two weeks before release on Pete TongÃ¢â‚¬â„¢s Essential Mix. One week later it was Ã¢â‚¬ËœThis WeekÃ¢â‚¬â„¢s Essential New TuneÃ¢â‚¬â„¢ while at the same time the Ã¢â‚¬Å“track of the weekÃ¢â‚¬Â on TiestoÃ¢â‚¬â„¢s Club Life (Episode 113). The track hit Beatport Top 20 in worldwide sales almost instantly and has been on Top 30 for over 4 weeks.\nAvicii in 2009 means killer vocal collaborations combined with his own high- energy style productions bringing a new sound to the scene. Avicii truly is the Sound of Now.\nPast big gig moments:\nAt WMC, Avicii played on Laidback LukeÃ¢â‚¬â„¢s Ã¢â‚¬Å“Superyou & MeÃ¢â‚¬Â party (@ Club Louis) alongside Luke himself, A-Trak (Kanye West DJ), Bart B More, Chocolate Puma and The Party Squad among others, who were very impressed by the way this young DJ could read the crowd. At another WMC event, Avicii played together with Philgood alongside Stephan M, Norman Doray, Arno Cost, Denis The Menace, Big World, and moreÃ¢â‚¬Â¦\nCurrent travels:\nAvicii is just back from Las Vegas where he was working with many different artists under Ultra Records.\nPress coverage (France):\nAvicii did a big interview where he was named Ã¢â‚¬Å“The Swedish FutureÃ¢â‚¬Â (as a replacement of Swedish House Mafia) in the May 2009 issue of French DJ magazine Ã¢â‚¬Å“Only For DJsÃ¢â‚¬Â.\nIndustry support:\nStill at the beginning of his career, Avicii has already been honoured in support by the likes Tiesto, Roger Sanchez, Pete Tong, Laidback Luke, Dirty South, Axwell, Sebastian Ingrosso, Eric Morillo, Joachim Garraud, Kaskade, Chris Lake and Greg Cerrone among many other heavy names in the industry.\n\n', '0', '197314436965197_10083422212.jpg', 'No', '5', '0', '2011-03-14', '0.0', '0000-00-00', '0', 'admin'),
