(117167, 195274060507604, 1656166341, 19, 23, 'SUNNERY JAMES & RYAN MARCIANO', '25', '10:00 PM', '02:30 AM', '', '', 'SUNNERY JAMES & RYAN MARCIANO, BREAKTHROUGH DJ PRODUCER OF 2010 FROM SWEDISH HOUSE MAFIA\n\nticket available at www.sensosupperclub.com\n\n***VIP TABLE RESERVATION AT 407 246 1755***\n\n\nwww.sj-rm.com\nwww.sensosupperclub.com\n\nSunnery James and Ryan Marciano, two notable personalities with a single goal: to entertain as many people as possible with their deep and funky house sound. As a DJ duo, they are irresistible. Put them in a DJ booth together and instant interaction and chemistry is there, with an eye for the audience and an ear for each other. Effortlessly adapting to one another seems to be no problem for these two best friends and partners in crime. From the moment they entered the DJ profession, they agreed to do something serious with their common passion: house music. Quickly after their first gig together Sunnery and Ryan established themselves as top DJs.Besides performing, they are very busy with producing. Even that is something they do together. As if they donÃ¢â‚¬â„¢t see enough of one another during gigs and their private lives, theyÃ¢â‚¬â„¢re also studio buddies. In May 2008 they released their first track Ã¢â‚¬ËœPina. One month later, Sunnery and Ryan released the club hit Ã¢â‚¬ËœLift U UpÃ¢â‚¬â„¢, featuring Melvin Reese and Chappell. After these successful productions, Sunnery & Ryan continued with tracks such as Ã¢â‚¬ËœThe DesertÃ¢â‚¬â„¢, which has been released on D.O.N.S.Ã¢â‚¬â„¢s Kingdome Cuts, and several remixes such as Sander KleinenbergÃ¢â‚¬â„¢s Ã¢â‚¬ËœThis Is Our NightÃ¢â‚¬â„¢ and KaskadeÃ¢â‚¬â„¢s Ã¢â‚¬ËœDynastyÃ¢â‚¬â„¢.In February 2010, Sunnery and Ryan launched their very own Ã¢â‚¬ËœAmazone ProjectÃ¢â‚¬â„¢ event in Heineken Music Hall Amsterdam. 5500 fans came to join the SJ-RM-hype and witnessed an exclusive 5-hour-set. The Amazone Project compilation album entered #2 in the charts. Amazone Project also hosted areas at the Dirty Dutch Indoor event (30.000 visitors) and the Dirty Dutch VS The World Festival. The SJ-RM journey continuous in 2010, where Sunnery James & Ryan Marciano will make their debut at the prestigious Sensation event in Amsterdam Arena on July 3rd. Sunnery and Ryan will also join the Swedish House Mafia club nights at Pacha Ibiza during the summer season.', '0', '195274060507604_1656166341.jpg', 'No', '5', '1', '2011-03-14', '0.0', '0000-00-00', '0', 'admin'),
