(117169, 139987939400406, 134807053201297, 19, 23, 'Vinyl Junkies Internet Radio Show | DJ Jade on Party95.com', '44', '12:00 AM', '02:00 AM', '', '', 'Vinyl Junkies | DJ Jade broadcasting every Wednesday Night\n12am-2am | www.Party95.com\n\n( VINYL JUNKIES | UNDERGROUND SOUND )\nAll mixes will be 100% Pure Vinyl! Music played will range from the roots of dance music from the early 80''s to today''s cutting edge BreakBeats & House. Come enjoy some of the rarest & most collectible Vinyl in the World!\n\nUnderground Sound | Keeping Vinyl Alive since 1987.\n\n( Special Edition Vinyl Junkies as follows for Party95.com )\n) AAHZ Edition | 3.09\n) House Edition | 3.16\n) BreakBeat Edition | 3.23\n) Progressive & Alternative Edition | 3.30\n\n( Please support local E.D.M. & support Party95.com )\n\n-----------------------------------------------------------------\n\n( DJ JADE | UNDERGROUND SOUND )\n) Owner since 1987.\n) Event Designer, Marketing Strategist, Professional DJ\n\n) 1987-1988 | Head DJ for MTV in the Park\nDaytona Beach, Fl.\n) 1987-1988 | DJ for Def Jam Comedy Hour with Kid Capri\nDaytona beach Fl.\n) 1988-1995 | Personal DJ for Jamie Foxx of in Living Colour\nNorth America & Internationally\n) 1988-1996 | Head DJ for N.B.L. ( National Bicycle League)\nNorth America for BMX Racing & Ramp Jamz\n) 1988-1996 | Head DJ for U.G.P. ( Underground Products )\nNorth America for BMX Racing & Ramp Jamz\n) 1996-2004 | Head DJ for H.O.B. ( House of Blues)\nOrlando Fl. for Progressive & Alternative Concerts\n) 2004-2010 | Head DJ & Exclusive Sound Company for Team Extreme\n1st Professional Stunt Team ever sponsored by a Factory Ride.\n) 2004-2010 | Head DJ & Exclusive Sound Company for STUNTWARS\nLargest Stunt Competition in the World.\n) 2006 -Current | DJ for Team FMX ( Freestyle Moto-X)\nMobile Metal to Metal Rigs that travel the World.\n) 2008-Current | Head DJ for East Coast Track Builders & SUPERCROSS\nIndoor Moto-X Racing for the East Coast\n) 2009-Current | Event D