(117171, 205788592765269, 749913746, 19, 23, 'The Firm & Culture Climax Introduce :: "PLAY" Every Wednesday', '25', '10:00 PM', '02:30 AM', '', '', 'The Firm & Culture Climax Introduce a brand new weekly experience every Wednesday night....\n\n:::::::PLAY:::::::\n\nDistinctively diverse & social atmosphere where those 21 & Up with a mature state of mind can step outside of the usual.\n\nThere''s never a cover charge to come play with us and the drinks are $4 until midnight.\n\nBottle Specials for those who have VIP in mind are $100 Ciroc and Moet Rose - 2 for $225 until midnight.\n\nYou should only expect the best Top 40, Hip Hop, Reggae, House, R&B, Old School, and more from two of your favorite DJs...\n\nDJ POINTBLANC & DJ ET\n\nIf you need more information or are interested in reserving VIP, please text 321.276.5608 or email jae@pushmgt.com.\n\n', '0', '205788592765269_749913746.jpg', 'No', '5', '1', '2011-03-14', '0.0', '0000-00-00', '0', 'admin'),
