(117182, 166907563361246, 100002092524118, 19, 23, 'Self Awareness Rally: "Who Am I and What Was I Created to Do?"', '26', '06:00 PM', '09:00 PM', '', '', 'Are you interested in finding your inner "HERO" or are you wanting to help your teen find theirs.  Join in with U.N.I.T.Y., Active Concerned Citizens, We 3 Sisters, Inc.  and a host of other community organizations for this 2 day event.  You don''t want to miss out on it!!!!\n\nMISSION:\nTo educate our youth in the local and surrounding communities on whom they really are through self-preservation and identification.  \n\nPLEASE REGISTER FOR THE 3-ON-3 TOURNAMENT IF YOU ARE PLANNING TO COMPETE!!!\nALL OTHER PARTICIPANTS CAN PURCHASE TICKETS @ THE DOOR FOR $1\n\nSchedule of Events\nJuly 29th:  		3-on-3 Tournament @ 6 pm\n\nJuly 30th: 		Self-Awareness Workshops - 10 am - 2:30 \n				Concert - 7 pm\n\n******Special Guest Include*******	\nAlphonso Roundtree (former Miami Dolphin)\nSupa Dave (rapper)\nGigalo Weeze\nProdigal Son (rapper)\nand many more....\n		\nGo to www.selfawarenessrally.eventbrite.com to register\n', '0', '166907563361246_100002092524118.jpg', 'No', '5', '0', '2011-03-14', '0.0', '0000-00-00', '0', 'admin'),
