(117224, 197764003580982, 149167491791333, 19, 23, '|| RALF Exclusive 3h djset || 19.03 NRG SuperClub - JokerEventi 320.3344093', '52', '10:00 PM', '06:00 AM', '', '', 'Sabato 19 Marzo 2011\n\nNRG SUPER CLUB\nCiampino, Roma\n\nSuper Star Dj\n/// RALF /////////// Exclusive 3 hours dj set\n\nPlus Special Dj \n>> MARCO BONUCCI (Welcome Back to NRG)\n\nWarm Up Dj \nValerio Finardi\n\n\n------------------------------------------------------------\nIngresso ridotto esclusivamente in lista JOKER\n------------------------------------------------------------\n\n:::: INFORMAZIONI & CONTATTI ::::\nLista.Tavoli.Omaggi per gruppi\nGIORGIO\ncell. 320.3344093\nemail: giopas89@live.it\n\nFacebook Profile\nGiorgio Passos\nhttp://www.facebook.com/Giorgio.JokerEventi\n\nFacebook Official Event Page\nJoker Eventi roma\nhttp://www.facebook.com/pages/Joker-Eventi-Roma/149167491791333\n\nJoker Eventi Roma CocoricÃƒÂ² Official Group\nhttp://www.facebook.com/home.php?sk=group_132599130138746\n\n---------------------------------------------------------------------------------------\nDJ Ralf Biografia\nAntonio Ferrari, aka DJ Ralf, nasce il 20/09/1957 a Bastia Umbra in provincia di Perugia e fin dalla piÃƒÂ¹ tenera etÃƒÂ  viene ribattezzato Ralf da amici e familiari.\nDopo aver lavorato in piccoli locali della sua provincia approda alla consolle del CocoricÃƒÂ² dove tuttora ÃƒÂ¨ Resident DJ ogni primo sabato del mese. Oltre che al CocoricÃƒÂ² ha lavorato e lavora in moltissimi altri locali famosi, sia in Italia che all''estero: Adrenaline, Alterego, Area City, Divinae Follie, Echoes , Ethos Mama, Fluid, Goa, Guendalina, Hollywood (serata Pervert), Maffia, Matis, Mazoom, Metropolis, Muretto, Pervert, Pleigine, Red Zone, Tenax , Villa delle Rose, Amnesia di Ibiza, Cavo Paradiso di Mykonos, Crobar di Miami in occasione della Winter Music Conference, Ministry of Sound di Londra, Pacha di Ibiza, Roxy di Amsterdam, Space di Ibiza, Vertigo di LondraÃ¢â‚¬Â¦\nHa stretto regolari collaborazioni con l''organizzazione delle "Folies de Pigalle", con "Colazione Da Tiffany" e dal ''94 fino al 2004 con il Made In Italy Ibiza sia in Italia ma soprattutto ad Ibiza. Nel 2001 ÃƒÂ¨ stato regular guest al Ministry of Sound di Londra nella serata chiamata Rulin''Ã¢â‚¬Â¦\nHa scritto per moltissimi anni una rubrica tutta sua chiamata "Touch and Go" per la rivista Discoid dove nel recensire i dischi, esprimeva le sue opinioni e raccontava le sue avventure personali e nonÃ¢â‚¬Â¦ \nDurante la settimana della moda milanese lo si trova alla consolle della sfilata di D-Squared2Ã¢â‚¬Â¦\nNel 2003 gli viene dedicata una puntata nel documentario del regista Alberto D''Onofrio, DJ''S TRIP , trasmesso su da Cult Network (SKY)Ã¢â‚¬Â¦ Un vero e proprio viaggio alla scoperta della sua vita professionale e personaleÃ¢â‚¬Â¦ \nNel 2006 da vita alla sua etichetta discografica LATERRA RECORDINGS.\nLa prima release I''VE DONE IT scritta, composta e prodotta dallo stesso Ralf insieme all''amico oltre che stimato dj e produttore Alex Neri.\nLe altre release sono KRADDA di Ricky Montanari & Lele Pasini ; TUNGUSKA / TOYS di Federico Locchi & Frankie Watch ; LU RAGNO_IMPOVERITO di Dario Lotti & Guido Nemola "electropizzica" Remix ( opera di Cesare dell'' Anna ) con incluso il remix dei Pastaboys; ETRURIA di Luca Agnelli; DJ SOSSA PJ di Sossa e Marco Scocchi; COLOMBA / MARCA LA RUTA di Sossa, Scocchi e Adicto Sound ; LAZY & SLOW / FUTURA IS BACK di Carlo CaritÃƒÂ .\nNell''estate del 2007 ha presentato, dal 10 luglio all''11 settembre, al Privilege di Ibiza il suo party , "Alma", di cui ha curato personalmente l'' identita'' musicale e in cui si ÃƒÂ¨ esibito insieme a djs del calibro internazionale quali Steve Bug, Timo Maas, Mathew Johnson, Ellen Allien e molti altri.', '0', '197764003580982_149167491791333.jpg', 'No', '5', '0', '2011-03-15', '0.0', '0000-00-00', '0', 'admin'),
