(117241, 215005070934, 100000041014390, 19, 23, 'CCHS Class of 1991, 20-Year Reunion; Friday, 01 July, AND Saturday, 02 July', '25', '06:00 PM', '12:00 AM', '', '', 'The planning for The CCHS Class of 1991, 20-year reunion is in full swing.  CASUAL FRIDAY NIGHT ON 01 JULY, FOLLOWED BY A MORE FORMAL EVENT ON SATURDAY, 02 JULY 2011; AN OPPORTUNITY TO ATTEND ONE, OR BOTH!  Gladys Perez is graciously donating her time to lead the planning effort from her South Florida location. Please send Gladys (and/or me) your input and let us know what you think... LOOKING FORWARD TO SEEING AS MANY AS POSSIBLE!  Cheers, Brian', '0', '215005070934_100000041014390.jpg', 'No', '5', '0', '2011-03-15', '0.0', '0000-00-00', '0', 'admin');
