(117253, 132957936746808, 100000136613412, 19, 23, 'Ultra Music Festival', '25', '01:00 PM', '11:30 PM', '', '', 'Ultra Music Festival is an outdoor electronic music event held annually in Miami, Florida, United States during the Winter Music Conference which occurs annually during the month of March. It is a 2-day event (although it was a 1-day event until 2007, and has been announced to be 3 days in 2011) that takes place across 12 different stages featuring over 200 artists, DJs, producers and promoters. It was announced on the second kjjknight of Ultra Music Festival 2010 that UMF 2011 in Miami would be a three day event.\nFrom 2001 to 2005, UMF was held outdoors in Bayfront Park, Miami. The first two UMFs (1999, & 2000) were actually held on South Beach in Miami Beach, however UMF attendance exceeded the possible beach permits and was subsequently moved to the venue of Bayfront Park. The top DJs, artists, and VJ (video performance artist) of the evening perform in the amphitheater designed to hold thousands of attendees. There is a second main stage (called the ''Sound stage'') and 10 other specialized music areas scattered throughout the park featuring Dubstep, Drum and Bass, House, Techno, Electro, Breakbeats, Trance, and other various styles of electronic music.\nIn 2005 the concert was so popular that it sold out. With the festival growing so big, in 2006 the Miami event had been moved to an even bigger venue, Bicentennial Park, next door to its past home. In 2007, with Winter Music Conference in full swing, Ultra Music Festival had its first 2-Day Event held at Bicentennial Park with a record breaking 50,000+ electronic music fans. Ultra Music Festival celebrated its 10th anniversary on Friday and Saturday, March 28 and 29th, 2008, where an announcement was made that the festival had set a new City of Miami record for the number of tickets sold at a single event. It is estimated that over 70,000 people attended. This year, 2010, Ultra Music Festival was again held at Bicentennial Park with headliners such as Axwell, Tiesto, David Guetta, DJ Big Rebs, Deadmau5, and many more. It took place from Friday, March 26th (4:00PM to 12:00A) to Saturday, March 27th (12:00PM to 12:00AM).\nIn 2010, Ultra Music Festival made history by completely selling out. It was one of the highest grossing musical festivals in the United States.\nUltra Music Festival, in association with Ultra Records, produces an event in New York City''s Central Park called ULTRA:NY, which also sold out in 2005. The success has brought Ultra:NY back for a second year.\nUltra Music Festival is currently presenting a radio show each week on Sirius satellite radio.', '0', '132957936746808_100000136613412.jpg', 'No', '5', '0', '2011-03-15', '0.0', '0000-00-00', '0', 'admin'),
(117254, 132013006869980, 38909561, 19, 23, 'Jilly Willy''s Dirty 30 Event', '25', '10:00 PM', '01:00 AM', '', '', 'Come on out on Saturday Night March 19th for Jill Beyer''s 30th Birthday Party!  Normally we wouldn''t post an age but, this is a milestone!  \n\nParty is going down at BOSS Nightclub on Pine St.  \n\nNO COVER!  and 5 Bottles have been Reserved!  VIP is set for those in our party.  We got the room with beds and a private bar.  \n\n10 dollar donation is optional to cover price of bottles.  See you all there!', '0', '132013006869980_38909561.jpg', 'No', '5', '0', '2011-03-15', '0.0', '0000-00-00', '0', 'admin'),
(117255, 200190473338187, 134807053201297, 19, 23, 'PROJECT ONE | 6.25 Orlando''s 1st ever DAY RAVE', '25', '10:00 AM', '03:00 AM', '', '', 'PROJECT ONE | 6.25 Orlando''s 1st ever DAY RAVE\nan Underground Sound Production.\n\nHOSTED by | JADE of UNDERGROUND SOUND\n\nPROJECT ONE...\nOrlando''s 1st ever DAY RAVE uniting all of Orlando''s E.D.M. artists & crews under ONE roof on ONE day. This event will cover all genres of E.D.M. over a 17 hour period. Club 57 West will be completely blacked out & Underground Sound will bring an additional 20,000 watts of power to bring the total Sound System to a face melting 70,000 watts of Pure Power!\n\nThis project has been in the works for the past (2) years. Underground Sound''s roots are & always will be Kimball & Icey. Remembering the days of past when EVERYONE showed up & each party was another living dream is what has driven me to do this. Orlando has been a hub for some of the biggest E.D.M. artists & shows on the planet.\n\nWith that being said... I say WE STILL ARE! Our local E.D.M. artists are straight Bad-2-da-Bone! This project is to showcase as many of Orlando''s local E.D.M. artists as possible in ONE day! \n\nPROJECT ONE represents One Love + One Vibe= Positive Energy!\n\n\n\nOrlando''s E.D.M. Crews participating | more T.B.A.\n-------------------------------------------------------------\n) Future Sound of Breaks | F.S.O.B.\n) Fundamental Breakz Collective\n) Next Level Productions | N.L.P\n) M-Toxin \n) Static System Music\n) F.S.E.D.M | Full Sail\n) Muze Entertainment\n) Dancing Zombies\n) Hydrophonic Entertainment\n) Orlando Trance Movement\n) Jungala \n) House Flyz\n) P.M. Entertainment\n) Digital Artillery\n) Underground Sound\n) more T.B.A.\n\n\nOrlando''s  E.D.M. Artists participating | more T.B.A.\n--------------------------------------------------------------\n) Stylus\n) Security\n) Rob-E\n) Orlando\n) Sandy\n) Jimmy Joslin\n) Andy Hughes\n) Prime Minister\n) Elusive\n) Cyberian Soundz\n) Rob Restittuto\n