(117258, 187484734620691, 114126825276504, 19, 23, 'Trance Vs House - The Best Of Both Worlds -  @ Suite B Lounge', '25', '09:00 PM', '02:30 AM', '', '', 'Orlando Trance Movement Presents:\n\nTHE BEST OF BOTH WORLDS\n(Trance vs House)\n\nSaturday\nApril 23rd, 2011.\n\nCome To Experience A New Concept..\nNever seen before in Orlando..\n\nOpenning Set By\n\nYamil Lugo\nIcebar, Suite B, Undergroundradio.tv\nwww.yamillugo.com\n\nTrance:\n\n*Cyberian Soundz\nOrlando Trance Movement\nwww.cyberiansoundz.com\n\n*Avlish\nSweet Science Records\n\nHouse:\n\n*X-Andy\nIcebar, Boss, Suite B Resident\n\n*Norbey D\nBoss, Suite B Resident\n\nDrink Specials All Night\n\nSuite B Lounge\n50 East Central Blvd.\n(Entrance On Magnolia Ave.)\nDowntown Orlando\n\nBecome a Fan Suite B Page:\nhttp://www.facebook.com/pages/Suite-B-Lounge/205873418983\n\nBecome A Fan Orlando Trance Movement Page:\nhttp://www.facebook.com/OrlandoTranceMovement\n\nThe Trance Movement Radioshow (last 10 episodes)\nhttp://cyberiansoundz.podomatic.com/\n\nInvite your friends!', '0', '187484734620691_114126825276504.jpg', 'No', '5', '0', '2011-03-15', '0.0', '0000-00-00', '0', 'admin'),
(117259, 200017936689068, 134807053201297, 19, 23, 'BOOMBOX at Suite B Lounge | April 20 ( DJ Soul & Evolv3 Birthday Bash )', '25', '10:00 PM', '03:00 AM', '', '', 'April 20 at Suite B Lounge | DJ Soul & Evolv3 Birthday Bash!\n\n((( BOOMBOX ))) .. ((( BOOMBOX ))) .. ((( BOOMBOX )))\n100% BREAKBEATS .. 100% BREAKBEATS .. 100% BREAKBEATS\n\n( Hosted by | JADE of UNDERGROUND SOUND )\n\n( DJ SOUL )\nThe name says it all when you talk about this artist. Old School to the core & Nu Skool with today''s technology. DJ Soul gives a one of kind performance each time he plays. I''ve had the privilege of knowing & working with this artist for 15+ years now & hands down one of the most technical DJ''s u will ever see & hear. Tell your friends.. Tell your mommy & daddy... Tell your boss u need the next day off cuz  DJ Soul is extra special.\n \n( DJ SOUL celebrating his birthday on this night! )\n\n( Do NOT miss this show | DJ SOUL in da house! )\n\n( DJ EVOLV3 ) P.M. Entertainment\nThis Orlando artist has been around the scene & played just about every club in Downtown Orlando. For over 8 years now this dj has been blowing apart systems and setting new standards. He has held down residences all over Orlando and has played in Europe throughout his dj career.He has opened up for some of the greatest dj''s around which include Dj Hyper,Stanton Warriors,Dj Icey, and Jackal n Hyde just to name a few.His dj sets deliver a blend of dance floor driven funky breaks, to electro house,to hip hop, to mash-ups and even his own music production which allowed him to launch his own label this year called "Czech''s Mix Brand Music" and had his "Bass Down Low Remix'' hit 6 different radio stations across the U.S..Through all of his accomplishments this year it has landed him a spot at Ultra Music Festival.You have been invited to be blown apart by this dj''s intense energy which is becoming infectious across the country\n\n( DJ EVOLV3''s celebrating his birthday on this night! )\n\n( Do NOT miss this show | DJ EVOLV3 in da house! )\n\n\n\n( BOOMBOX DJ''s THIS WEEK! )\n) 10:00pm-11:30am | Charles Anthony\n) 11:30am-1:30am | DJ Soul\n) 1:30-close | Evolv3\n\n\n( Orlando''s Biggest & Only Weekly 100% BREAKBEAT Night !! )\n\n\n( BOOMBOX UPCOMING GUEST DJ''s )\n) Mar 16 | 100% Pure Vinyl BoomBox\n) Mar 23 | Stylus\n) Mar 30 | Rob-E\n) Apr 06 | Jimmy Joslin\n) Apr 13 | 100% Pure Vinyl BoomBox ( Underground Sound Version )\n) Apr 20 | SOUL & EVOLV3 BIRTHDAY BASH\n) Apr 27 | DJ JDub\n\n( UNDERGROUND SOUND invites all BREAK DANCERS! )\n\n( BOOMBOX SPONSORS )\n) Drop Shop Record Store\n) Kokopellis Fight Gym\n) Social Menace Clothing\n) Horizon Signs\n) Party 95.com\n\n( BOOMBOX VENUE )\n) Suite B Lounge\n) 50 E. Central Blvd.\n) Downtown Orlando FL. 32801\n) Corner of Central & Magnolia | Next to Club Vain )\n\n\nUNDERGROUND SOUND since 1987.\nInfo Line | 407-236-DJDJ\n\n\n( ONE LOVE + ONE VIBE = POSITIVE ENERGY! )', '0', '200017936689068_134807053201297.jpg', 'No', '5', '0', '2011-03-15', '0.0', '0000-00-00', '0', 'admin'),
