(117266, 202953363063718, 63792242283, 19, 23, '"THE UNITED NATIONS  1st FRIDAY EVENT" APRIL 1ST ', '25', '10:00 PM', '03:00 AM', '', '', 'TORRENCE LIFESTYLES  - JADE EVENTS - THE FIRM - MERCEDES BENZ of SOUTH ORLANDO  EAGERLY INVITE YOU TO........\nTHE \nU.N.\nTHE UNITED NATIONS EVENT\n \nSIMPLY THE MOST DIVERSE PARTY EXPERIENCE IN ORLANDO\n \nFRIDAY APRIL 1ST 2011\n \nat\nCRAVE RESTAURANT & LOUNGE \n\n \nWITH A NONE REPETITIVE SOUNDTRACK BY\n\nDJ POINTBLANC & DJ OFFISHAL IN THE MAIN ROOM\nSPINNING ONLY THE BEST HIP HOP -NEW SCHOOL- ISLAND MUSIC\nTOP 40- MUSIC FROM THE 80''S 90''S AND BEYOND\n\n DJ DVS - IN THE LATIN & HOUSE ROOM  12AM -3AM\n\nDJ EMCEE ON THE MERCEDES BENZ R&B & NEO SOUL PATIO.\n\nPARTY HOST: JAY DEEZY\n---------------------------------------------------------------------------------\n\n \n \nHOST COMMITTEE:\n JOHNNIE TORRENCE - ERNEST WILSON - JAE JOHNSON\n \n \nPLEDGE  YOUR ALLEGIANCE ON\n Friday April 1st \nand every First Friday thereafter\n \nSEXY - SOPHISTICATED ATTIRE WILL ONLY BE ADMITTED\nDRESS TO BE ADMIRED - VERY STRICT STYLECODE.\n \n 10P - 3A\n \nCRAVE RESTAURANT & LOUNGE  - 4158 Conroy Road\n\n \n\nTHE U.N.  is the culmination of a few of the hottest promoters in Orlando\n putting aside egos to bring you one of the most diverse party experiences ever in the city..', '0', '202953363063718_63792242283.jpg', 'No', '5', '0', '2011-03-15', '0.0', '0000-00-00', '0', 'admin'),
(117267, 158856697501684, 732614525, 19, 23, 'No Gas Day', '25', '12:00 AM', '11:30 PM', '', '', 'Facebook has done some pretty amazing things. Anything from reuniting lost loves and old friends to creating a revolution in oppressed countries. I want to see if we can organize an event to reach as many people as possible to have a day designated to boycott all gas stations across the planet.\n\nI know this has been tried before, but not since Facebook has become the phenomenon that it has. So, send this event to everyone on your friends list, and let''s see if we can start our own revolution, by letting these oil companies know we aren''t going to stand for these prices!\n\nSimply avoid all gas stations on March 31, 2011. And if you can go one step further, don''t even drive that day. Why not let Facebook help us spread the word? However, don''t forget your local mom and pop shop. Go IN and buy something that day. Make a point of it!\n\nWe''re mad as hell, and are tired of watching the big oil companies laugh all the way to the bank while we all suffer. Let''s do this!\n\nSide note:\nAnd since there seems to be so much confusion about what we are trying to do here, let me clarify now. This is NOT about thinking we are going to send gas prices plummeting downward because of this one day. This is about taking a stand, together, against greedy people whose commodity happens to affect ALL OTHER commodity''s prices. What other commodity does that? Let''s be the nation of innovators that we are and come up with something better!\n\nAnd if you can, people that belong to organized groups, be it churches, bikers, or even a group of your friends, go and rally at one of your local government offices that day. Let your officials know enough is enough!\n\nAnd while you are at it... Reduce, reuse, and recycle. :)\n', '0', '158856697501684_732614525.jpg', 'No', '5', '0', '2011-03-15', '0.0', '0000-00-00', '0', 'admin'),
(117268, 137641519633586, 134807053201297, 19, 23, 'BOOMBOX at Suite B Lounge | March 30 ( DJ Rob-E )', '25', '10:00 PM', '03:00 AM', '', '', 'March 30 at Suite B Lounge | DJ Rob-E\n\n((( BOOMBOX ))) .. ((( BOOMBOX ))) .. ((( BOOMBOX )))\n100% BREAKBEATS .. 100% BREAKBEATS .. 100% BREAKBEATS\n\n( Hosted by | JADE of UNDERGROUND SOUND )\n\n( DJ ROB-E )\nA true veteran at his trade, Rob-e has been gracing the decks since 1979. From his start at Midway Roller Rink in Crystal River, Fl. All the way to traveling North and Central America in the 1990''s, Rob-E has done it all.\nFrom his countless residencys including Orlando''s Club at Firestone''s\nSunday Skool, Infinity and The Groove at Citywalk (just to name a few)\nall the way to Club Ultra and Velvet in San Deigo, Rob-E has graced the\ndecks for thousands of fans! With over 30 records under his belt and 3\nhit CD''s, and after taking a break to start his family, Rob-E is back and\nready to turn up the BOOMBOX!\n\n( DJ ROB-E is a true professional in every sense of the word! )\n\n( Do NOT miss this show | An Orlando Legend )\n\n( DJ ROB-E SPONSORS )\n) Social Menace Clothing\n) Underground Sound\n\n( BOOMBOX DJ''s THIS WEEK! )\n) 10:00pm-11:30am | Shal Underground Sound\n) 11:30am-1:30am | DJ ROB-E\n) 1:30-close | Buonaducci & Funkbaby\n\n\n( Orlando''s Biggest & Only Weekly 100% BREAKBEAT Night !! )\n\n\n( BOOMBOX UPCOMING GUEST DJ''s )\n) Feb 02 | Prime Minister\n) Feb 09 | Underground Sound vs N.L.P.\n) Feb 16 | Baby Girl\n) Feb 23 | Force of Habit | Chris Marchese\n--------------------------------------------------\n) Mar 02 | Intellect Underground Sound\n) Mar 09 | Sandy\n) Mar 16 | 100% Pure Vinyl BoomBox\n) Mar 23 | Stylus\n) Mar 30 | ROB-E\n) Apr 06 | Jimmy Joslin\n\n( UNDERGROUND SOUND invites all BREAK DANCERS! )\n\n( BOOMBOX SPONSORS )\n) Drop Shop Record Store\n) Kokopellis Fight Gym\n) Social Menace Clothing\n) Horizon Signs\n) Party 95.com\n\n( BOOMBOX VENUE )\n) Suite B Lounge\n) 50 E. Central Blvd.\n)