(117285, 150120081711293, 134807053201297, 19, 23, 'BOOMBOX at Suite B Lounge | March 16 ( 100% Pure Vinyl )', '44', '10:00 PM', '03:00 AM', '', '', 'March 16 at Suite B Lounge | ( 100% Pure Vinyl BOOMBOX! )\n\n((( BOOMBOX ))) .. ((( BOOMBOX ))) .. ((( BOOMBOX )))\n100% VINYL BREAKBEATS .. 100% VINYL BREAKBEATS \n\n( Hosted by | JADE of UNDERGROUND SOUND )\n\n( 100% PURE VINYL! )\nUnderground Sound''s DJ Jade will return to the art of Vinyl at least 1x every 2 months. This night will represent Old School BreakBeat Classics & take the audience back to a time when music had Funk & Soul. With today''s music technology & so many DJ''s breaking into the industry as CD or Computer Only artists the Vinyl DJ is becoming a lost art. \n\nCome watch DJ''s spin real records & match beats with ONLY their fingertips. Vinyl Artists supplying the crowd with Analogue Energy. 100% Pure Vinyl !!\n\n( Keep Vinyl Alive & Support Your Local Record Store )\n\nhttp://www.facebook.com/event.php?eid=123559877717883#!/group.php?gid=134807053201297\n( Please join Vinyl Junkies by Underground Sound )\n\n( BOOMBOX DJ''s THIS WEEK! )\n) 10:00pm-12:00am | Shal Underground Sound Crew\n) 12:00-2:00am | Jade & Security\n) 2:00am-3:00am | Chad Haun ( Celestial Rhythm )\n\n( BOOMBOX UPCOMING GUEST DJ''s )\n) Feb 09 | Underground Sound vs N.L.P.\n) Feb 16 | Baby Girl\n) Feb 23 | Force of Habit | Chris Marchese\n) Mar 02 | Intellect Underground Sound\n) Mar 09 | Sandy\n) Mar 16 | 100% PURE VINYL BOOMBOX\n) Mar 23 | Stylus\n) Mar 30 | Rob-E\n) Apr 06 | Jimmy Joslin\n\n( UNDERGROUND SOUND invites all BREAK DANCERS! )\n\n( BOOMBOX SPONSORS )\n) Drop Shop Record Store\n) Village Inn Pizza\n) Kokopellis Fight Gym\n) Horizon Signs\n) Party 95.com\n\n( BOOMBOX VENUE )\n) Suite B Lounge\n) 50 E. Central Blvd.\n) Downtown Orlando FL. 32801\n) Corner of Central & Magnolia | Next to Club Vain )\n\n\nUNDERGROUND SOUND since 1987.\nInfo Line | 407-236-DJDJ\n\n\n( ONE LOVE + ONE VIBE = POSITIVE ENERGY! )\n\n', '0', '1