(117305, 197382826960461, 1241855395, 19, 23, 'BlogTalk Radio show with Famous Lonnette McKee', '22', '11:00 PM', '11:30 PM', '', '', 'Listen in as we speak with LONETTE MCKEE, Producer/ Director/ Screenwriter/ Sonwriter/ Musician Lonette McKee''s Feature film credits include; Sparkle, Cuba, Which Way is Up and Brewster''s Millions - both opposite Richard Pryor; The Cotton Club and Gardens of Stone for Francis Coppola; Lift, for which she earned a Black Reel nomination. Other films include Honey, Men of Honor with Robert DeNiro and Cuba Gooding Jr., Round Midnight for lengendary French filmmaker Bertrand Tavenier, Jungle Fever, Malcom X, He Got Game and She Hate Me for Spike Lee. Television mini series and films include; Women of Brewser Place with Oprah Winfrey, for which she received an NAACP nomination, Having Our Say, Queen with Halle Berry, To Dance with Olivia, For Love of Olivia, both opposite Louis Gossett Jr. for CBS television network and Blind Faith for the Showtime Cable Network. Lonette also received an NAACP nomination for her appearences on the long-running CBS soap opera As The World Turns. Recently, Lonette did a recurring role on the NBC hit drama ''Third Watch''. Lonette was recognized in People Magazine''s ''Fifty Most Beautiful'' issue. Lonette studied film directing at The New School in New York. She teaches a master acting workshop at Centenary College in New Jersey, where she serves as an adjunct professor in the theater arts department. Lonette is currently producing her feature film ''Dream Street'', which she wrote and will direct. Fore more information on her check out her website at http://www.lonettemckee.com. For more information on Keith Johnsons Blog, intheredstyle.blogspot.com, and Free and Fun stuff to do in ATL go to cleanfreefun.blogspot.com', '0', '197382826960461_1241855395.jpg', 'No', '5', '0', '2011-03-22', '0.0', '0000-00-00', '0', 'admin'),
