(117319, 131345790269946, 149167491791333, 19, 23, '|| PAUL KALKBRENNER || Sab 16.04 LIVE CLUB - JokerEventiRoma 320.3344093', '22', '10:00 PM', '06:00 AM', '', '', 'Sabato 16 Aprile 2011 \n\nJoker Eventi Roma con la collaborazione di\nELITA FESTIVAL & MAGAZZINI GENERALI presents \n\n\n\n/// PAUL KALKBRENNER in concert //////////// \n\n\n+ ART DEPARTMENT \n\n+ FALTY DL \n\n\nApertura porte Ore 21\nInizio Ore 22\nIngresso agevolato per chi acquista la PREVENDITA! \n\n\n\n:::: INFORMAZIONI & CONTATTI ::::\nGIORGIO\ncell. 320.3344093\nemail: giopas89@live.it\n\nFacebook Profile\nGiorgio Passos\nhttp://www.facebook.com/Giorgio.JokerEventi\n\nFacebook Official Event Page\nJoker Eventi roma\nhttp://www.facebook.com/pages/Joker-Eventi-Roma/149167491791333\n\nJoker Eventi Roma CocoricÃƒÂ² Official Group\nhttp://www.facebook.com/home.php?sk=group_132599130138746\n\n\n-------------------------------------------------------------------------------------\nSabato 16 Aprile appuntamento imperdibile con la collaborazione tra ELITA FESTIVAL & MAGAZZINI GENERALI che presentano nella location post-industriale degli Hangar Bicocca di Milano un party che passerÃƒÂ  alla storia! \nIl piÃƒÂ¹ grosso fenomeno dance mondiale del 2010 arriva da Berlino e si chiama PAUL KALKBRENNER! \nAttualmente i suoi concerti stanno registrando il Sold Out in tutta Europa. Il suo sound originale e melodico muove le masse ed il 16 aprile infiammerÃƒÂ  l''Hangar Bicocca! \n\nAlla base del succeso di PAUL KALKBRENNER cÃ¢â‚¬â„¢ÃƒÂ¨ unÃ¢â‚¬â„¢attivitÃƒÂ , tra produzioni musicali e live act, di 15 anni. Quando il muro di Berlino crollÃƒÂ² Paul aveva 12 anni. La colonna sonora di quei giovani e della maggior parte della sua generazione era la techno music. \nAlla fine dellÃ¢â‚¬â„¢adolescenza Kalkbrenner inizia una serie di esibizioni come dj, spesso a fianco dellÃ¢â‚¬â„¢amico Sascha Funke, che lo portano col tempo a concentrarsi in studio sulla produzione di musica propria. Il suo debutto discografico avviene nel 1999, sotto le sembianze di Paul DB+, per poi crescere artisticamente tra le mura della BPitch Control di Ellen Allien, che rimane estasiata dal suo sound Ã¢â‚¬ËœcinematicoÃ¢â‚¬â„¢ ben rappresentato da pubblicazioni quali Ã¢â‚¬Å“KollektivÃ¢â‚¬Â, Ã¢â‚¬Å“ZeitÃ¢â‚¬Â, Ã¢â‚¬Å“Press OnÃ¢â‚¬Â ed i recenti Ã¢â‚¬Å“KeuleÃ¢â‚¬Â e Ã¢â‚¬Å“TatÃƒÂ¼-TataÃ¢â‚¬Â. \nAllÃ¢â‚¬â„¢inizio del 2006 il regista tedesco Hannes StÃƒÂ¶hr, decise di contattare Kalkbrenner. La sua idea era di produrre un film su un musicista nella Techno City durante il nuovo millennium, e Paul avrebbe dovuto comporne la colonna sonora. La cosa prese piede e durante i loro scambi Hannes realizzÃƒÂ² che Paul poteva non solo contribuire alla musica ma poteva anche rappresentare la scelta perfetta come protagonista del film. Senza esitazione Paul accettÃƒÂ² lÃ¢â‚¬â„¢offerta e cosÃƒÂ¬ si accaparrÃƒÂ² il ruolo del dj e produttore Ikarus. Insieme concordarono anche il titolo del film, Berlin Calling. Nel 2007 iniziarono le riprese e nellÃ¢â‚¬â„¢ottobre del 2008 il film fu proiettato in anteprima a Berlino dove ricevette critiche positive. La colonna sonora fu un successo strepitoso, in particolar modo la traccia Ã¢â‚¬Å“Sky and SandÃ¢â‚¬Â con il vocale del fratello di Paul, Fritz. \n\n\nAIUTACI A PROMUOVERE L''EVENTO!\n\nDopo che hai confermato la tua partecipazione clicca "Seleziona gli Invitati" in alto a sinistra e seleziona chi tra i tuoi amici pensi possa essere interessato all''evento e Clicca su "Condividi" in alto e pubblica l''evento sulla tua bacheca o passa parola\nMostra tutto ', '0', '131345790269946_149167491791333.jpg', 'No', '5', '0', '2011-03-22', '0.0', '0000-00-00', '0', 'admin'),
