(117327, 182169281808716, 149167491791333, 19, 23, 'TIME WARP Mannheim 2011 + Warm Up Cocoon - Joker Eventi 320.3344093', '22', '08:00 PM', '12:00 PM', '', '', 'TIME WARP 2011 \n\nil 2 aprile 2011 ÃƒÂ¨ il giorno di riferimento per tutti i fans della musica elettronica che si radunano da ogni parte del globo nella cittÃƒÂ¡ di Mannheim come al solito nella Maimarkthalle che sarÃƒÂ  naturalmente allestita con luci, laser ed effetti video tra i piÃƒÂ¹ moderni. \nI piÃƒÂ¹ importanti e prestigiosi djs internazionali cosÃƒÂ­ come i newcomer saranno presenti anche quest''anno per suonare davanti ad un pubblico fantastico proveniente da tutto il mondo! \n\nNon mancare a questo party memorabile! \n\nSabato 2 Aprile 2011 \n\nMaimarkthalle - Mannheim - Francoforte - Germania \n\ndalle ore 19:30 del sabato alle ore 14:00 della domenica \n\n----------------------- \n\nLine up:\n\nSven VÃƒÂ¤th\n\nCarl Cox\n\nRichie Hawtin 6h dj Set\n\nRicardo Villalobos\n\nLoco Dice\n\nLuciano b2b Carl Craig\n\nDubfire\n\nMarco Carola\n\nChris Liebing\n\nMagda\n\nMonika Kruse\n\nJosh Wink\n\nKarotte\n\nMoonbootica\n\nLexy & K-Paul\n\nOliver Koletzki\n\nMathias Kaden\n\nMasomenos\n\nButch\n\nStefan Goldmann\n\nLen Faki\n\nNic Curly\n\nSeeBase\n\nGerd Janson Nekes\n\nSteffen Baumann\n\nSasch Bcc\n\nStefano Libelle\n\nBlast Sl\n\nJay Edit\n\n\n\nLive:\n\nSlam\n\nPlanetary Assault Systems\n\nGaiser\n\nMarek Hemmann\n\nLaserkraft 3\n\nHenrik Schwarz\n\nLaurent Garnier pres. LBS\n\nSubsonic Park\n\nPulshar\n\n\n##########################################\n\n::: INFORMAZIONI :::\nBiglietti\nPacchetti\nPrezzi \nGiorgio\nph. 320.3344093\nemail: giopas89@live.it\n\nFacebook Official Event Page\nhttp://www.facebook.com/pages/Joker-Eventi-Roma/149167491791333\n\n\n########################################\n\n\n- INFORMAZIONI PACCHETTI VIAGGIO:\n\n-------------------------------------------------------------------------------\nPREVENDITA 61 Ã¢â€šÂ¬ INVIO TRAMITE EMAIL IN FORMATO PDF.\n---------------------------