RE 7.00):145 EURO\n\nPIACENZA(PIACENZA SUD ORE7.30):145 EURO\n\nMILANO(FAMAGOSTA 8.00):145 EURO\n\nMANTOVA(7.00A BREVE LA ZONA DI RITROVO):150 EURO\n\nBRESCIA(7.30 A BREVE LA ZONA DI RITROVO):150 EURO\n\nBERGAMO(8.30 A BREVE LA ZONA DI RITROVO):150 EURO\n\nFIRENZE(3.30 A BREVE LA ZONA DI RITROVO):150 EURO\n\nTORINO(9.00 A BREVE LA ZONA DI RITROVO):150 EURO\n\nROMA(00.30 A BREVE LA ZONA DI RITROVO):190 EURO\n\nNAPOLI(21.30 A BREVE LA ZONA DI RITROVO):205 EURO\n\n\n\nI PREVENTIVI VOLO SONO RIGOROSAMENTE DA MANDARE A ME INDICANDO:\nNUMERO PERSONE,DATA DI PARTENZA E DI RITORNO,IL VOSTRO NOME E IN 24/48 ORE VIENE MANDATO IL PREVENTIVO!!\n\nAIUTACI A PROMUOVERE L''EVENTO!\n1)Clicca su partecipo\n2)Clicca su "Seleziona gli invitati" a sinistra sotto al flyer dell''evento e seleziona chi tra i tuoi amici pensi possa essere interessato.\n3)Passa Parola\n4)Condivi se ti piace questo evento\n\n\n', '0', '182169281808716_149167491791333.jpg', 'No', '5', '0', '2011-03-22', '0.0', '0000-00-00', '0', 'admin'),
