(117356, 176150835742788, 682530268, 19, 23, 'Prayer Request Line for Healing of Jason Pinder', '25', '04:30 PM', '07:30 PM', '', '', 'My baby brother has been told he needs a double lung transplant.  I have a firm belief in a living God who heals and am asking for believers world-wide to stand in the gap with me and my family and pray for God''s strength and guidance in his life and in the decisions the doctors make for his health.', '0', '176150835742788_682530268.jpg', 'No', '5', '0', '2011-03-22', '0.0', '0000-00-00', '0', 'admin'),
