(117358, 154191304617660, 1439162205, 19, 23, 'Abundant Life International Fellowship Fourth Annual Holy Convocation', '25', '07:00 PM', '07:00 PM', '', '', 'TO: All of our honored guests of the Abundant Life International Fellowship Inc.\n\nFROM: The Most Reverend Dr. Derrick L. Young Archbishop & Patriarch of Abundant Life International Fellowship Inc.\n\nSUBJECT: You are officially invited to attended the Abundant Life International Fellowship Inc. Fourth Annual Holy Convocation.\n\nMy brothers and sisters I would like to officially invite you to attend this great event. Their will be a lots of teaching, fellowshipping, and preaching at this Holy Convocation. The primary focus of this convocation will be teaching men and women of God the tools that they need to increase their spiritual growth. Some of the subject areas that we will be covering at this convocation are Church History, Homiletics, The Five Fold Ministry and much, much more!!!\n\nThe Abundant Life International Fellowship Inc. Fourth Annual Holy Convocation will be starting on Friday June 24, 2011 at 7PM and it will be ending on Sunday June 26, 2011 at 7PM. This event will be taking place at the Holiday Inn Port St. Lucie. The address for this hotel is 10120 South US Highway 1 in Port Saint Lucie, FL 34952. \n\nRegistration for this event is twenty dollars for adults and children eighteen years old and younger are free. Please make your cashiers checks or money orders payable to Abundant Life International Fellowship Inc. at mail it to it P.O. Box 2258 Stuart, FL 34995-2258. The deadline for all regristrations will be June 10, 2011. If you have any questions you can email us at abundantlifeifinc@gmail.com or write us at Abundant Life International Fellowship Inc. and mail it P.O. Box 2258 Stuart, FL. 34995-2258. \n\nAlso please call the Holiday Inn Port Saint Lucie today to reserve your room for the Holy Convocation today!!! The number to the hotel is (772) 337-2200. When you call them please make sure that you tell them that you are attending the Abundant Life International Fellowship Inc. Holy Convocation. So you can get the discounted group room rate. The room rates are as follows $69.99 for two double beds and $74.00 for a mini suite. \n\nDress code will be a black suit and a black clergy shirt for the men. Bishops can wear Roman Purple, but not Scarlet unless you are a Presiding Bishop. The dress code for women in the ministry will be a black suit and black clergy shirt. Seating is available to the first seventy guests only and they are on a first come first serve bases. If you have any questions feel free to call. (772) 634-5233 or email abundantlifeifinc@gmail.com. This is going to be a great Holy Convocation and I am looking forward to seeing you there!!! God bless each and every one of you. Have a great day!!!\n\nYour Brother In Christ,\nThe Most Reverend Dr. Derrick L. Young \nArchbishop & Patriarch of \nAbundant Life International Fellowship Inc.\nhttp://abundantlifeifinc.webs.com/\nwww.twitter.com/abundantlifeif \n', '0', '154191304617660_1439162205.jpg', 'No', '5', '0', '2011-03-22', '0.0', '0000-00-00', '0', 'admin');
