(117387, 203409253020945, 520508120, 19, 23, 'MyCityMonday 1 year anniversary party', '22', '10:00 PM', '01:00 AM', '', '', 'Royalty ent. present MyCityMonday. \nFor over a year now we bring you a venue that is all about Orlando underground hip hop & R&B seen. We start the night with banging out music by DJ RIOTT and then open up the mics for a top of the dome freestyle session and then go in with Orlando Finest performances. \n\nFor the 1yr anniversary we have A PERFORMANCE BY MAYBACH recording artist CASH CHRIS and guest "Street Crumbs own" DJ KRAZY YOGI, 102JAMZ GREG G, ALL HOSTED BY JAY LOVE OF 102 JAMZ.\n \ndrink specials all night / and sign up for the MyCityMonday officail Mix-Tape hosted by J-LOVE 102JAMZ \ndoors open at 10 pm / sign up to perform email: royentgrp@yahoo.com\nlook us up on twitter.   ', '0', '203409253020945_520508120.jpg', 'No', '5', '0', '2011-03-22', '0.0', '0000-00-00', '0', 'admin'),
