(117394, 191982707506903, 134807053201297, 19, 23, 'Vinyl Junkies Internet Radio Show | DJ Jade on Party95.com', '44', '12:00 AM', '03:00 AM', '', '', 'Vinyl Junkies | DJ Jade broadcasting every Wednesday Night\n12am-2am | www.Party95.com\n\n( VINYL JUNKIES | UNDERGROUND SOUND )\nAll mixes will be 100% Pure Vinyl! Music played will range from the roots of dance music from the early 80''s to today''s cutting edge BreakBeats & House. Come enjoy some of the rarest & most collectible Vinyl in the World!\n\nUnderground Sound | Keeping Vinyl Alive since 1987.\n\n( Special Edition Vinyl Junkies as follows for Party95.com )\n) AAHZ Edition | 3.09\n) House Edition | 3.16\n) BreakBeat Edition | 3.23\n) Progressive & Alternative Edition | 3.30\n\n( Please support local E.D.M. & support Party95.com )\n\n-----------------------------------------------------------------\n\n( DJ JADE | UNDERGROUND SOUND )\n) Owner since 1987.\n) Event Designer, Marketing Strategist, Professional DJ\n\n) 1987-1988 | Head DJ for MTV in the Park\nDaytona Beach, Fl.\n) 1987-1988 | DJ for Def Jam Comedy Hour with Kid Capri\nDaytona beach Fl.\n) 1988-1995 | Personal DJ for Jamie Foxx of in Living Colour\nNorth America & Internationally\n) 1988-1996 | Head DJ for N.B.L. ( National Bicycle League)\nNorth America for BMX Racing & Ramp Jamz\n) 1988-1996 | Head DJ for U.G.P. ( Underground Products )\nNorth America for BMX Racing & Ramp Jamz\n) 1996-2004 | Head DJ for H.O.B. ( House of Blues)\nOrlando Fl. for Progressive & Alternative Concerts\n) 2004-2010 | Head DJ & Exclusive Sound Company for Team Extreme\n1st Professional Stunt Team ever sponsored by a Factory Ride.\n) 2004-2010 | Head DJ & Exclusive Sound Company for STUNTWARS\nLargest Stunt Competition in the World.\n) 2006 -Current | DJ for Team FMX ( Freestyle Moto-X)\nMobile Metal to Metal Rigs that travel the World.\n) 2008-Current | Head DJ for East Coast Track Builders & SUPERCROSS\nIndoor Moto-X Racing for the East Coast\n) 2009-Current | Event Designer for BOOMBOX Wednesdays | Suite B\nBiggest & Only Weekly 100% BREAKBEAT Night in Central Fl.\n) 2009-Current | Event Designer for FULL SERVICE Tuesdays | Suite B\nA Service Industry Night the 1st of its Kind!\n) 2009-Current | Event Designer for OLD SCHOOL vs NU SKOOL\n11 Months at Suite B. Lounge | Currently at Club 57 West Orlando\n) Currently | Suite B. Lounge Resident DJ & Event Designer\nSuite B. Lounge | 50 E. Central Blvd. Orlando Fl.32801\n) Currently | Club 57 West Resident DJ & Event Designer\nClub 57 West | 57 W. Pine St. Orlando Fl. 32801\n\n( ADDITIONAL EXPERIENCE )\n) Head DJ of Visage\n) Original Head DJ for Cairo\n) Original DJ for the Den at Club Firestone\n) Opening DJ for the Blue Room\n) Rotating DJ for Infinity & Cyberzone\n\n----------------------------------------------\n\nUnderground Sound since 1987\nInfo Line | 407-236-DJDJ\n\nONE LOVE + ONE VIBE = POSITIVE ENERGY!', '0', '191982707506903_134807053201297.jpg', 'No', '5', '0', '2011-03-22', '0.0', '0000-00-00', '0', 'admin'),
(117395, 127553023981857, 134807053201297, 19, 23, 'BOOMBOX at Suite B Lounge | March 23 ( DJ Stylus )', '44', '10:00 PM', '03:00 AM', '', '', 'March 23 at Suite B Lounge | DJ STYLUS\n\n((( BOOMBOX ))) .. ((( BOOMBOX ))) .. ((( BOOMBOX )))\n100% BREAKBEATS .. 100% BREAKBEATS .. 100% BREAKBEATS\n\n( Hosted by | JADE of UNDERGROUND SOUND )\n\n( DJ STYLUS )\nFor anyone who has been in the Electronic Music Scene in the South Eastern portion of the United States, the name Stylus is known as legendary. Many nights, events and venues Stylus has lead listeners on a journey of epic sound. From his selection of wicked intelligent breaks, drivinÃ¢â‚¬â„¢ progressive house, and extended seamless mixes, Stylus has inspired many who have been standing with ears perked up and a grin on their face, waiting for the next track to drop into place.\nThe journey begins in 1991, when Stylus was a resident at The Beacham Theater (Orlando FL.) for itsÃ¢â‚¬â„¢ Friday night event dubbed WWIII. Unfortunately the Beacham Theater was nearing the end of itsÃ¢â‚¬â„¢ reign as the premiere night club in Orlando, due to the owner having a child with severe health problems, combined with the stress of club management, the owner elected to close the doors after many years of success. That brief stint was all Stylus needed to make his mark, and connect with individuals that would later give him his next residency at OrlandoÃ¢â‚¬â„¢s legendary ABYSS. Paired up with fellow resident DJ D-Xtreme, the Duo took the Orlando Club scene to an entirely new level. The unstoppable wave of positive vibe, fueled by cutting edge music and intense flowing mixes is something that is discussed by club goers to this day. The ABYSS was notorious for holding incredible events, where Stylus and D-Xtreme would host many guest DJs from across Florida. Some of these events lasted over 48 hours, and caught the attention of city officials. And as all good things come to an end, the ABYSS was forced to close its doors, in an attempt to make a dent in OrlandoÃ¢â‚¬â„¢s massive dance music scene.\nThat dent, was but a mere scratch of what was to come. Stylus continued to give the masses what they came for. As loyal followers would travel across the southeast to catch a set at one of many clubs, or events. Some of these clubs were residencies and others were frequent guest spots. The list is long, but some of the most recognizable names are, The Edge, Club @ Firestone, Limelight (NY), Marz, Icon, Renaissance, Cloud Nine, The Coliseum, Masquerade, Paragon, Warsaw, The Louve, Santuary, Dimensions, Outer Limits, Aurora, Club 2000, Velvet, Impact, 600 North, Club Electra, Mimosa, and Area 51, to name only a few. The list of events/music festivals is nearly endless, stretching from Miami FL to Calgary Alberta, Canada. Events such as Zen I - VI, Cozmos I,II,III, Usuaya, Passion I,II,III, Energy I,II,III, Endo-Meka, Labyrinth, Unity I,II, Hyperspace I,II, SÃƒÂ©ance I,II, D-lusion, Epic, Glide, Quench, Fusion, Elevation I,II,III, Electrolyte, and the ever famous Ultra music festival. These events drew crowds from 5,000 to over 25,000 in attendance, and hosted artists such as Prodigy, Moby, Hybrid, Rabbit in the Moon, Quiver, Deep Sky, Union Jack, Underworld, Cosmic Baby, Blue Amazon, Way out West, Crystal Method, Cirrus, BT, Electric Skychurch, Uberzone, Dubtribe, Cotton Club, Rhythm Section, Mix Factory, Spiritual Being, Dynamix II, Jackal and Hyde, Young American Primitive, as well as Global DJs Paul Van Dyk, Tiesto, Sasha, John Digweed, Paul Oakenfold, Peter Tong, Sandra Collins, Timo Maas, Dave Seaman, Josh Wink, DJ Icey, Keioki, Nick Warren, Adam Freeland, Rennie Pilgram, Christopher Lawrence, and countless others.\n\nStylus has re-engaged himself back in the studio to pick up where he left off, and give those loyal fans more of what they long for, that ever evolving style and cutting edge sound.\n\n\n( Do NOT miss this show | An Orlando Legend )\n\n( Orlando''s Biggest & Only Weekly 100% BREAKBEAT Night !! )\n\n( BOOMBOX DJ''s THIS WEEK! )\n) 10:00pm-11:30am | Chris Fade Underground Sound\n) 11:30am-1:30am | DJ STYLUS\n) 1:30-close | Jayson Butera\n\n( BOOMBOX UPCOMING GUEST DJ''s )\n) Feb 23 | Force of Habit | Chris Marchese\n) Mar 02 | Intellect Underground Sound\n) Mar 09 | Sandy\n) Mar 16 | 100% Pure Vinyl Boombox\n) Mar 23 | STYLUS\n) Mar 30 | Rob-E\n) Apr 06 | Jimmy Joslin\n\n( UNDERGROUND SOUND invites all BREAK DANCERS! )\n\n( BOOMBOX SPONSORS )\n) Drop Shop Record Store\n) Kokopellis Fight Gym\n) Horizon Signs\n) Party 95.com\n\n( BOOMBOX VENUE )\n) Suite B Lounge\n) 50 E. Central Blvd.\n) Downtown Orlando FL. 32801\n) Corner of Central & Magnolia | Next to Club Vain )\n\n\nUNDERGROUND SOUND since 1987.\nInfo Line | 407-236-DJDJ\n\n\n( ONE LOVE + ONE VIBE = POSITIVE ENERGY! )', '0', '127553023981857_134807053201297.jpg', 'No', '5', '0', '2011-03-22', '0.0', '0000-00-00', '0', 'admin'),
