(117479, 215158925164753, 150000718388595, 19, 23, 'Fusion Friday w/dj Mixed Feelings @The LOFT (Daytona)', '22', '10:00 PM', '03:00 AM', '', '', 'Friday, April 15th join us for a night of smooth beats... South Beach Style!  Dj Mixed Feelings will be on the decks providing the sounds that make you wanna get down.  ;)\n\n$5 Three Olives Martinis ALL NIGHT LONG!!!\n\nEntrance is INSIDE Stingrays Sports Saloon.\nCover charge is just $5 for locals!\n	\nThe LOFT provides a unique atmosphere not available anywhere else in the Daytona Beach area.\n\nA playground for grown-ups...\n\nA new and different nightlife concept that balances comfort and luxury with high-energy excitement. Open three nights a week, The LOFT offers live entertainment, DJ music, Art, an eye-catching menu of delicious food, and a unique selection specialty martinis as well as classic cocktails, fine wines and spirits.\n\nWith Dj''s playing everything from top40 and dance, to house, acid jazz, dubstep and more, The LOFT has something for everyone.\n\nFor those looking to dine after dark, look no further. Designed to be ordered individually or shared among friends, The LOFTs menu features new twists on old classics and trendy yummy treats. Enjoy the latenight menu or order a full meal prepared to your liking.\n\nYou can also enjoy the outdoor seating in the courtyard or catch the game in our Sports Bar downstairs on one of the many HDTV''s and BIG screens.\n\nWhether an intimate date, meeting friends, or just a night on the town, The LOFT is the perfect nightlife destination - a place where your senses are stirred, not shaken.\n\n', '0', '215158925164753_150000718388595.jpg', 'No', '5', '1', '2011-04-01', '0.0', '0000-00-00', '0', 'admin'),
