(117494, 170061369713454, 749913746, 19, 23, 'U.N. The United Nations Event :: Simple the Most Diverse Party in Orlando', '22', '10:00 PM', '02:30 AM', '', '', 'The FIRM :: Torrence Lifestyles :: Jade Events : Mercedes Benz of South Orlando Present:	\n\nTHE U.N. "THE UNITED NATIONS EVENT"\nSIMPLY THE MOST DIVERSE PARTY EXPERIENCE IN ORLANDO\n\nFRIDAY APRIL 1ST 2011\n@ CRAVE RESTAURANT & LOUNGE\n\nSelectively soundtracked by:\nDJ POINTBLANC & DJ M-SQUARED IN THE MAIN ROOM\nSPINNING ONLY THE BEST HIP HOP -NEW SCHOOL- ISLAND MUSIC\nTOP 40- MUSIC FROM THE 80''S 90''S AND BEYOND\n\nDJ OFFISHAL - IN THE LATIN & HOUSE ROOM 12AM -3AM\n\nDJ EMCEE ON THE MERCEDES BENZ R&B & NEO SOUL PATIO.\n\nHosted by:\nJAY DEEZY\n\nBrought to you by:\nJOHNNIE TORRENCE - ERNEST WILSON - JAE JOHNSON\n\n\nPLEDGE YOUR ALLEGIANCE ON\nFriday April 1st\nand every First Friday thereafter\n\nDress code is impeccable - style is a must so please don''t get caught at the door with any athletic wear, extra baggy clothing.  \n\nInterested in VIP or need more information?\nEmail jae@pushmgt.com or text 321.276.5608', '0', '170061369713454_749913746.jpg', 'No', '5', '1', '2011-04-01', '0.0', '0000-00-00', '0', 'admin'),
(117495, 199737266716216, 10083422212, 19, 23, 'TOCADISCO @ Venue', '20', '10:00 PM', '03:00 AM', '', '', 'Nocturnal LIVE\npresents\nTOCADISCO first ever Tampa appearance April 1st @ The Venue!!!!\n\nOpening sets by High Frequency, Gemini and Doco!!!\n...\nTickets ONLY $10!!!!!!! 18+ for Everyone for this special event!\n\nFor Info, VIP & Tickets call 727.455.5665 / www.Nocturnaltix.com\n\nTocadisco Bio:\n\nAfter 15 years of being a professional DJ, over 60 international remixes, one album and more than ten successful singles in his pocket the multi-instrumentalist and award winning super producer Tocadisco looks into a bright future.\n\nThere is no other producer and DJ in the international dance scene today that has proven his talent in so many different musical ways. Be it remixing artists like Moby, Tiga and New Order or writing successful singles with David Guetta or Fisherspooner. No other artists'' music was played by the biggest names of underground club music and has also been used for commercial tv advertising!!!\n\nIn 2008 Tocadisco released his first artist album "SOLO", wrote a song on David Guetta''s album "Pop Life" and achieved an MTV Award for "Best International Dance 2008".\n\nIn 2009 there will be a new Tocadisco album released! Tocadisco has already traveled the globe a lot of times and in 2009 his world tour will take him to Australia, Brazil, USA, Canada, Mexico and of course everywhere in Europe.See More \n\n18 & up welcome\n\nFriday April 1st', '0', '199737266716216_10083422212.jpg', 'No', '5', '1', '2011-04-01', '0.0', '0000-00-00', '0', 'admin'),
(117496, 202953363063718, 63792242283, 19, 23, '"THE UNITED NATIONS  1st FRIDAY EVENT" APRIL 1ST ', '20', '10:00 PM', '03:00 AM', '', '', 'TORRENCE LIFESTYLES  - JADE EVENTS - THE FIRM - MERCEDES BENZ of SOUTH ORLANDO  EAGERLY INVITE YOU TO........\nTHE \nU.N.\nTHE UNITED NATIONS EVENT\n \nSIMPLY THE MOST DIVERSE PARTY EXPERIENCE IN ORLANDO\n \nFRIDAY APRIL 1ST 2011\n \nat\nCRAVE RESTAURANT & LOUNGE \n\n \nWITH A NONE REPETITIVE SOUNDTRACK BY\n\nDJ POINTBLANC - DJ M-SQUARED &  DJ OFFISHAL IN THE MAIN ROOM\nSPINNING ONLY THE BEST HIP HOP -NEW SCHOOL- ISLAND MUSIC\nTOP 40- MUSIC FROM THE 80''S 90''S AND BEYOND\n\n DJ DVS - IN THE LATIN & HOUSE ROOM  12AM -3AM\n\nDJ EMCEE ON THE MERCEDES BENZ R&B & NEO SOUL PATIO.\n\nPARTY HOST: JAY DEEZY\n---------------------------------------------------------------------------------\n\n \n \nHOST COMMITTEE:\n JOHNNIE TORRENCE - ERNEST WILSON - JAE JOHNSON\n \n \nPLEDGE  YOUR ALLEGIANCE ON\n Friday April 1st \n\n \nSEXY - SOPHISTICATED ATTIRE WILL ONLY BE ADMITTED\nDRESS TO BE ADMIRED - VERY STRICT STYLECODE.\n \n 10P - 3A\n \nCRAVE RESTAURANT & LOUNGE  - 4158 Conroy Road\n\n \n\nTHE U.N.  is the culmination of a few of the hottest promoters in Orlando\n putting aside egos to bring you one of the most diverse party experiences ever in the city..', '0', '202953363063718_63792242283.jpg', 'No', '5', '1', '2011-04-01', '0.0', '0000-00-00', '0', 'admin'),
(117497, 173948019321444, 749913746, 19, 23, 'Release :: The Ultimate Happy Hour Fridays', '25', '06:00 PM', '11:00 PM', '', '', 'NEED A RELEASE FROM YOUR WORK WEEK? LOOK NO FURTHER...\n\nThis is not your average happy hour event...it''s a different atmosphere & scene. Chill in the lounge ~ Party in the side room ~ Socialize on the rooftop!\n\nThe Barstaff at VAIN are top notch & serving you $4 Top Shelf drinks from 6-11pm & we offer COMPLIMENTARY FOOD for all as well.\n\nDon''t forget to reserve your VIP with\n$80 bottles of Ciroc and $100 bottles of Moet Rose\n(until 9pm)\n\nDJ Grinz continues to bring you the hottest vibe playing Top 40, Hip Hop, Reggae, Latin, House and More to release after the work week.\n\nHosted by Barnard Fleurima & Jae - we''ll definitely keep you entertained for the night!\nDance - dance - dance!!!\n\nIt may be happy hour....but dress is stylish & sexy, club attire only after 9pm.\n\nTo reserve VIP tables or for more information, email jae@pushmgt.com or TEXT 321.276.5608 or 407.791.8784. ', '0', '173948019321444_749913746.jpg', 'No', '5', '1', '2011-04-01', '0.0', '0000-00-00', '0', 'admin'),
(117502, 198223063534345, 100000420267426, 19, 23, 'Strike up the Heat - Dance Showcase', '25', '07:00 PM', '10:00 PM', '', '', 'Tickets are $5 if bought prior to the show, and $8 at the door. It''s going to be the BEST DANCE showcase at MSA ever! So people really need to come. There will be both MSA Heat, and Strikers routines, but also solos, duets, and group dances created with the people in both teams. \nThere will be hip hop, jazz, ballroom, and contemporary styles of dance.\nWe really want your support, SO COME!', '0', '154887021235098_1218459296.jpg', 'No', '5', '1', '2011-04-01', '0.0', '0000-00-00', '0', 'admin'),
(117505, NULL, 0, 19, 26, 'Eventgrabber Launch Celebration at the Y.E.S Party', '18', '09:00 PM', '03:00 AM', '', '', 'Special Invite for Eventgrabber Members !!\r\n\r\n	\r\nJ.leon &amp; Ricky Padilla\r\nEagerly Invite you to attend...\r\n\r\nTHE INTRODUCTION TO THE CITIES HOTTEST NEW EVENT...\r\n\r\n...The Y.E.S. Party\r\n\r\nThis immaculate event called The Y.E.S. Party\r\nHas rightfully taken it&#039;s sole position as the most anticipated and exclusive event in Orlando!\r\nInfluencing Influencers and Trendsetters alike,\r\nspecifically catering to those few that seek not only a party but an event that embodies;\r\nextravagance, magnificence, splendor and sophistication.\r\n\r\nFor the Y.oung at heart and spirit,\r\nThe city&#039;s beautiful E.lite in mind and apperance\r\nand for the Exclusive few that share a S.ophisticated life style but still want to dance till their Guccis fly off their feet!\r\n\r\nTHIS IS, THE EVENT!\r\n\r\nOFFERING 2 ROOMS TO ROCK YOUR WORLD!\r\n\r\nMUSICALLY:\r\nWe hit every continent, island and Common Wealth\r\nFrom SEAN CARTER to BONO, from the BRONX to IBIZA! YOUR EARS WILL BE ELATED!\r\n\r\nMAIN ROOM\r\nOPEN FORMAT FEEL GOOD MUSIC BY NYC&#039;S DJ NYSE\r\n\r\nIN THE HEAVEN LOUNGE UPSTAIRS\r\nHOUSE AND LATIN RYTHMS BY DJ JORDAN ACOSTA\r\n\r\nTHE V.ery I.mpressive P.re-Launch\r\nExclusively for those who Pre-Purchase their Tickets\r\nWe are opening the doors for you early with a few special treats\r\n9pm - 11pm Complimentary Appetizers\r\nComplimentary Brugal Rum and Hennessy Cocktails\r\n\r\nWardrobe must be superb&lt;\r\nSEMI-FORMAL is strongly suggested...\r\nLadies; nothing less then runway ready\r\nGentlemen; Suit Jackets are so necessary,\r\nall with a summer fresh aroma...\r\n\r\nTHE I.D.\r\nLadies 21+ Gentlemen 23+\r\nDoors open at 9pm\r\n\r\nTO PURCHASE ADVANCE TICKETS ONLINE http://TheYesParty.com/\r\nor call 407-310-2537\r\nFOR VIP RESERVATIONS AND MORE INFO 407-310-2537', 'Pre-Purchase Tickets link below', 'EG_YES_PARTY_082300.jpg', 'Yes', '6', '1', '2011-04-14', '0.0', NULL, '0', 'admin'),
